INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(1, 'Presidencia', 2, -1, 1, 1, 5, -1, '', 0, '', '', '', '', '', '', '', -1, -1, '', '', '', 0, 0),
(2, 'Ministerio de Agricultura y Desarrollo Rural', 2, 44, 1, 1, 5, 2, '899999028', 26, 'MINAGRICULTURA', '5712543300', '', '', '', 'https://www.minagricultura.gov.co', 'Avenida Jim&eacute;nez # 7A - 17', 33, 3, 'Aurelio Iragorri', 'El Ministerio de Agricultura y Desarrollo Rural se encarga de Formular, Coordinar y Evaluar las pol&iacute;ticas que promuevan el desarrollo competitivo, equitativo y sostenible de los procesos agropecuarios forestales, pesqueros y de desarrollo rural, con criterios de descentralizaci&oacute;n, concertaci&oacute;n y participaci&oacute;n, que contribuyan a mejorar el nivel y la calidad de vida de la poblaci&oacute;n colombiana.', 'data:image/jpeg;base64,', 4.60172, -74.0741),
(3, 'Ministerio de Ambiente y Desarrollo Sostenible', 2, 44, 1, 1, 5, 2, '830115395', 26, 'MINAMBIENTE', '5713323400', '', '', '', 'https://www.minambiente.gov.co/', 'Calle 37 # 8 - 40', 33, 3, 'Gabriel Vallejo', 'El Ministerio de Ambiente y Desarrollo Sostenible es el rector de la gesti&oacute;n del ambiente y de los recursos naturales renovables, encargado de orientar y regular el ordenamiento ambiental del territorio y de definir las pol&iacute;ticas y regulaciones a las que se sujetar&aacute;n la recuperaci&oacute;n, conservaci&oacute;n, protecci&oacute;n, ordenamiento, manejo, uso y aprovechamiento sostenible de los recursos naturales renovables y del ambiente de la naci&oacute;n, a fin de asegurar el desarrollo sostenible, sin perjuicio de las funciones asignadas a otros sectores.\r\n', 'https://storage.googleapis.com/pnn-web/uploads/2016/02/logo.jpg', 4.66003, -74.059),
(4, 'Ministerio de Comercio, Industria y Turismo', 2, 44, 1, 1, 5, 2, '830115297', 26, 'MINCIT', '5716067676', '', '', '5716067522', 'http://www.mincit.gov.co/', 'Calle 96 # 9A - 21', 33, 3, 'Cecilia &Aacute;lvarez', 'Leasing Bancoldex es una Compa&ntilde;&iacute;a de Financiamiento especializada en leasing y cr&eacute;dito comercial para la financiaci&oacute;n de activos productivos, diferenciada por un modelo de relaci&oacute;n personalizado y asesor, a partir del conocimiento y acompa&ntilde;amiento del cliente en el desarrollo de su capacidad productiva, respaldada en su tecnolog&iacute;a y su talento humano competente.\r\n', 'data:image/jpeg;base64,', 4.61587, -74.0713),
(5, 'Ministerio de Cultura', 2, 44, 1, 1, 5, 2, '830034348', 26, 'MINCULTURA', '5713424100', '', '', '5713816353', 'http://www.mincultura.gov.co/', 'Carrera 8 # 8 - 55', 33, 3, '', '', 'data:image/jpeg;base64,', 4.59662, -74.0775),
(6, 'Ministerio de Defensa Nacional', 2, 44, 1, 1, 5, 2, '899999003', 26, 'MINDEFENSA', '5713150111', '', '', '5713150111', 'http://www.mindefensa.gov.co/', 'Carrera 54 # 26 &ndash; 25 CAN', 33, 3, '', '', 'data:image/jpeg;base64,', 4.68954, -74.1316),
(7, 'Ministerio de Educaci&oacute;n Nacional', 2, 44, 1, 1, 5, 2, '899999001', 26, 'MINEDUCACI&Oacute;N', '+57 1 2222800', '+57 1 3078079', '', '+57 1 2224953', 'http://www.mineducacion.gov.co/', 'Calle 43 # 57 - 14 CAN', 33, 3, '', 'el ministerio de educacion busca Lograr una EDUCACI&Oacute;N DE CALIDAD, que forme mejores seres humanos, ciudadanos con valores &eacute;ticos, competentes, respetuosos de lo p&uacute;blico, que ejercen los derechos humanos, cumplen con sus deberes y conviven en paz. Una educaci&oacute;n que genere oportunidades leg&iacute;timas de progreso y prosperidad para ellos y para el pa&iacute;s.\r\n', 'data:image/jpeg;base64,', 4.64647, -74.0946);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(8, 'Ministerio de Hacienda y Cr&eacute;dito P&uacute;blico', 2, 44, 1, 1, 5, 2, '899999090', 26, 'MINHACIENDA', '5713811700', '5716021270', '', '5713812183', 'http://www.minhacienda.gov.co/', 'Carrera 8 # 6C - 38', 33, 3, 'Mauricio Cardenas', 'Somos el Ministerio que coordina la pol&iacute;tica macroecon&oacute;mica; define, formula y ejecuta la pol&iacute;tica fiscal del pa&iacute;s; incide en los sectores econ&oacute;micos, gubernamentales y pol&iacute;ticos; y gestiona los recursos p&uacute;blicos de la Naci&oacute;n, desde la perspectiva presupuestal y financiera, mediante actuaciones transparentes, personal competente y procesos eficientes, con el fin de propiciar: Las condiciones para el crecimiento econ&oacute;mico sostenible, y la estabilidad y solidez de la econom&iacute;a y del sistema financiero; en pro del fortalecimiento de las instituciones, el apoyo a la descentralizaci&oacute;n y el bienestar social de los ciudadanos.\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.59421, -74.0789),
(9, 'Ministerio de Justicia y del Derecho', 2, 44, 1, 1, 5, 2, '900457461', 26, 'MINJUSTICIA', '5714443100', '', '', '', 'http://www.minjusticia.gov.co/', 'Calle 53 # 13 - 27', 33, 3, '', 'El Ministerio de Justicia y del Derecho tendr&aacute; como objetivo dentro del marco de sus competencias formular, adoptar, dirigir, coordinar y ejecutar la pol&iacute;tica p&uacute;blica en materia de ordenamiento jur&iacute;dico, defensa y seguridad jur&iacute;dica, acceso a la justicia formal y alternativa, lucha contra la criminalidad, mecanismos judiciales transicionales, prevenci&oacute;n y control del delito, asuntos carcelarios y penitenciarios, promoci&oacute;n de la cultura de la legalidad, la concordia y el respeto a los derechos, la cual se desarrollar&aacute; a trav&eacute;s de la institucionalidad que comprende el Sector Administrativo.\r\n', 'data:image/png;base64,', 4.64018, -74.0654),
(10, 'Ministerio de Minas y Energ&iacute;a', 2, 44, 1, 1, 5, 2, '899999022', 26, 'MINMINAS', '5712200300', '', '', '', 'http://www.minminas.gov.co/', 'Calle 43 # 57 - 31 CAN', 33, 3, 'Tom&aacute;s Gonz&aacute;lez', '', 'data:image/png;base64,', 6.21316, -75.5595),
(11, 'Ministerio de Relaciones Exteriores', 2, 44, 1, 1, 5, 2, '899999042', 26, 'CANCILLERIA', '5713814000', '', '', '5713814747', 'http://www.cancilleria.gov.co/', 'Carrera 11 # 93 - 53 Piso 7', 33, 3, '', 'El Ministerio de Relaciones Exteriores y su Fondo Rotatorio, en desarrollo de sus funciones y comprometido con la mejora continua de la eficacia, eficiencia y efectividad del Sistema Integrado de Gesti&oacute;n propondr&aacute;, orientar&aacute;, coordinar&aacute; y ejecutar&aacute; la Pol&iacute;tica Exterior, administrando los recursos y el Servicio Exterior de la Rep&uacute;blica en condiciones de oportunidad y conveniencia\r\n', 'http://www.cancilleria.gov.co/sites/default/files/logo-cabezote-web-cancilleria.png', 4.67521, -74.0476),
(12, 'Ministerio de Tecnolog&iacute;as de la Informaci&oacute;n y las Comunicaciones', 2, 44, 1, 1, 5, 2, '899999053', 26, 'MINTIC', '5713443460', '', '', '', 'http://www.mintic.gov.co/', 'Edificio Murillo Toro Carrera 8A entre calles 12 y 13', 33, 3, 'David Andres Luna', 'El Ministerio de Tecnolog&iacute;as de la Informaci&oacute;n y las Comunicaciones, seg&uacute;n la Ley 1341 o Ley de TIC, es la entidad que se encarga de dise&ntilde;ar, adoptar y promover las pol&iacute;ticas, planes, programas y proyectos del sector de las Tecnolog&iacute;as de la Informaci&oacute;n y las Comunicaciones. Dentro de sus funciones est&aacute; incrementar y facilitar el acceso de todos los habitantes del territorio nacional a las Tecnolog&iacute;as de la Informaci&oacute;n y las Comunicaciones y a sus beneficios.\r\n\r\n', 'data:image/png;base64,', 4.60024, -74.0753),
(13, 'Ministerio de Transporte', 2, 44, 1, 1, 5, 2, '899999055', 26, 'MINTRANSPORTE', '5715953596', '', '', '5714287054', 'https://www.mintransporte.gov.co/', 'Avenida El Dorado CAN entre Carreras 57 y 59', 33, 3, 'Natalia Abello', 'El Ministerio de Transporte, como lo establece el Decreto 087 de 2011, es el organismo del Gobierno Nacional encargado de formular y adoptar las pol&iacute;ticas, planes, programas, proyectos y regulaci&oacute;n econ&oacute;mica del transporte, el tr&aacute;nsito y la infraestructura, en los modos carretero, mar&iacute;timo, fluvial, f&eacute;rreo y a&eacute;reo del pa&iacute;s.\r\n', 'data:image/png;base64,', 4.64618, -74.1032),
(14, 'Ministerio de Vivienda, Ciudad y Territorio', 2, 44, 1, 1, 5, 2, '900.463.725-2', 26, 'MINVIVIENDA', '5713323434', '', '', '', 'http://www.minvivienda.gov.co/', 'Carrera 6 # 8 - 77', 33, 3, 'Lu&iacute;s Felipe Henao', 'El Ministerio de Vivienda, Ciudad y Territorio contribuye a mejorar la calidad de vida de la ciudadan&iacute;a, promoviendo el desarrollo territorial y urbano planificado del pa&iacute;s y disminuyendo el d&eacute;ficit en vivienda urbana, agua potable y saneamiento b&aacute;sico, mediante la financiaci&oacute;n, y el desarrollo de la pol&iacute;tica p&uacute;blica, programas y proyectos correspondientes, con servicios de calidad y recurso humano comprometido.\r\n\r\n', 'http://www.minvivienda.gov.co/SiteAssets/images/logoHORIZONTAL.png', 4.59569, -74.0756),
(15, 'Ministerio del Interior', 2, 44, 1, 1, 5, 2, '830114475', 26, 'MININTERIOR', '5712427400', '', '', '', 'https://www.mininterior.gov.co/', 'Carrera 8 # 7 - 83', 33, 3, '', 'Somos el puente que acerca a la ciudadan&iacute;a con el Gobierno Nacional, brindando seguridad, equidad y respeto por los Derechos Humanos. Somos la entidad que trabaja por la convivencia de todos los colombianos. Promovemos un cambio desde el Interior por la convivencia en paz en todas las regiones de Colombia!\r\n\r\n\r\n', 'http://www.mininterior.gov.co/sites/default/files/galeria-imagenes/logo_webmin_2014.png', 4.59593, -74.0779);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(16, 'Ministerio del Trabajo', 2, 44, 1, 1, 5, 2, ' 830115226-3', 26, 'MINTRABAJO', '5714893900', '', '', '', 'http://www.mintrabajo.gov.co/', 'Carrera 14 # 99 - 33 pisos 6, 7, 10, 11, 12 y 13', 33, 3, 'Luis Eduardo Garz&oacute;n', 'El Ministerio de Trabajo no est&aacute; concebido para apagar incendios, sino para construir acuerdos, promover el empleo digno, proteger los derechos de 22 millones de colombianos en capacidad de trabajar, construir m&aacute;s y mejores empresas, fomentar la calidad del talento humano y buscar que en Colombia no haya un solo trabajador sin protecci&oacute;n social.\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.6838, -74.0474),
(17, 'Ministerio de Salud y Protecci&oacute;n Social', 2, 44, 1, 1, 5, 2, '830115226', 26, 'MINSALUD', '5713305000', '', '', '5713305050', 'http://www.minsalud.gov.co/', 'Carrera 13 # 32 - 76', 33, 3, '', 'El ministerio busca Dirigir el sistema de salud y protecci&oacute;n social en salud, a trav&eacute;s de pol&iacute;ticas de promoci&oacute;n de la salud, la prevenci&oacute;n, el tratamiento y la rehabilitaci&oacute;n de la enfermedad y el aseguramiento, as&iacute; como la coordinaci&oacute;n intersectorial para el desarrollo de pol&iacute;ticas sobre los determinantes en salud; bajo los principios de eficiencia, universalidad, solidaridad, equidad, sostenibilidad y calidad, con el fin de contribuir al mejoramiento de la salud de los habitantes de Colombia.', 'https://www.minsalud.gov.co/imgLayout/Ministerio%20de%20Salud%20y%20Proteccion%20Social.png', 4.62078, -74.0682),
(18, 'Departamento Administrativo de Ciencia, Tecnolog&iacute;a e Innovaci&oacute;n', 2, 32, 1, 1, 5, 2, '899999296', 27, 'COLCIENCIAS', '5716258480', '', '', '5716251788', 'http://www.colciencias.gov.co/', 'Calle 26 #57-41', 33, 3, '', 'COLCIENCIAS es la entidad p&uacute;blica que lidera, orienta y coordina la pol&iacute;tica nacional de Ciencia, Tecnolog&iacute;a e Innovaci&oacute;n, y el Sistema Nacional de Ciencia, Tecnolog&iacute;a e Innovaci&oacute;n para generar e integrar el conocimiento al desarrollo social, econ&oacute;mico, cultural y territorial del pa&iacute;s.\r\n', 'data:image/jpeg;base64,', 4.64511, -74.1016),
(19, 'Departamento Administrativo de la Funci&oacute;n P&uacute;blica', 2, 32, 1, 1, 5, 2, '899999020', 27, 'DAFP', '5713344080', '5713344086', '', '5713410515', 'http://portal.dafp.gov.co/', 'Carrera 6 # 12 - 62', 33, 3, '', 'Somos la entidad t&eacute;cnica, estrat&eacute;gica y transversal del Gobierno Nacional que contribuye al bienestar de los colombianos mediante el mejoramiento continuo de la gesti&oacute;n de los servidores p&uacute;blicos y las instituciones en todo el territorio nacional.\r\n\r\n', 'http://telepacifico.com/wp-content/uploads/2016/04/dafp.jpg', 4.5991, -74.0758),
(20, 'Departamento Administrativo de la Presidencia de la Republica', 2, 32, 1, 1, 5, 2, '899999083', 27, 'DAPRE', '5715629300', '', '', '', 'http://wp.presidencia.gov.co/', 'Carrera 8 # 7 - 26', 33, 3, '', 'Corresponde al Departamento Administrativo de la Presidencia de la Rep&uacute;blica, asistir al Presidente de la Rep&uacute;blica en su calidad de Jefe de Gobierno, Jefe de Estado y Suprema Autoridad Administrativa, en el ejercicio de sus atribuciones constitucionales y legales y prestar el apoyo administrativo necesario para dicho fin.\r\n\r\n\r\n', 'http://wp.presidencia.gov.co/SiteCollectionImages/presidencia-escudo-nuevopais.png', 4.5953, -74.0783),
(21, 'Departamento Administrativo del Deporte, la Recreaci&oacute;n, la Actividad F&iacute;sica y el Aprovechamiento del Tiempo Libre', 2, 32, 1, 1, 5, 2, '899999306', 27, 'COLDEPORTES', '5714377030', '', '', '', 'http://www.coldeportes.gov.co/', 'Avenida 68 # 55 - 65', 33, 3, '', 'El Departamento Administrativo del Deporte, la Recreaci&oacute;n, la Actividad F&iacute;sica y el Aprovechamiento del Tiempo Libre &ndash; COLDEPORTES tiene como objetivo, dentro del marco de sus competencias y de la ley, formular, adoptar, dirigir, coordinar y ejecutar la pol&iacute;tica p&uacute;blica, planes, programas y proyectos en materia el deporte, la recreaci&oacute;n, el aprovechamiento del tiempo libre y la actividad f&iacute;sica, para promover el bienestar, la calidad de vida, as&iacute; como contribuir a la salud p&uacute;blica, a la educaci&oacute;n, a la cultura, a la cohesi&oacute;n social, a la conciencia nacional y a las relaciones internacionales, a trav&eacute;s de la participaci&oacute;n de los actores p&uacute;blicos y privados.\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.66752, -74.0813);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(22, 'Departamento Administrativo Direcci&oacute;n Nacional de Inteligencia', 2, 32, 1, 1, 5, 2, '900475460', 27, 'DNI', '5714268859', '', '', '', 'http://www.dni.gov.co/', 'Avenida Calle 26 # 69 - 63 Of. 203', 33, 3, '', 'La Direcci&oacute;n Nacional de Inteligencia tiene como objeto desarrollar actividades de inteligencia estrat&eacute;gica y contrainteligencia para proteger los derechos y libertades de los ciudadanos y de las personas residentes en Colombia, prevenir y contrarrestar amenazas internas o externas contra la vigencia del r&eacute;gimen democr&aacute;tico, el orden constitucional y legal, la seguridad y la defensa nacional, as&iacute; como cumplir con los requerimientos que en materia de inteligencia le hagan el Presidente de la Rep&uacute;blica y el Alto Gobierno para el logro de los fines esenciales del Estado, de conformidad con la ley.\r\n', 'data:image/png;base64,', 4.65977, -74.1071),
(23, 'Departamento Administrativo Nacional de Estad&iacute;stica', 2, 32, 1, 1, 5, 2, '899999027', 27, 'DANE', '5715978300', '', '', '5715978399', 'http://www.dane.gov.co/', 'Carrera 59 # 26 - 70 Interior I - CAN', 33, 3, 'Mauricio Perferri', 'El Departamento Administrativo Nacional de Estad&iacute;stica, DANE,busca Producir y difundir informaci&oacute;n estad&iacute;stica de calidad para la toma de decisiones y la investigaci&oacute;n en Colombia, as&iacute; como desarrollar el Sistema Estad&iacute;stico Nacional.\r\n', 'https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcSreYOFdXMq6mO-Q5gpq1HGsvAwJhlXdL3qYfPm_Ac0zsTwB74yqq3-UIcv', 4.64691, -74.0979),
(24, 'Departamento Administrativo Para la Prosperidad Social', 2, 32, 1, 1, 5, 2, '900039533', 27, 'DPS', '5715960800', '5715960801', '5715960802', '5712844120', 'http://www.dps.gov.co/', 'Calle 7 # 6 - 54', 33, 3, '', 'Prosperidad Social es el organismo del Gobierno Nacional que busca fijar pol&iacute;ticas, planes generales, programas y proyectos para la asistencia, atenci&oacute;n y reparaci&oacute;n a las v&iacute;ctimas de la violencia, la inclusi&oacute;n social, la atenci&oacute;n a grupos vulnerables y su reintegraci&oacute;n social y econ&oacute;mica. \r\n', 'data:image/jpeg;base64,', 4.59454, -74.0769),
(25, 'Departamento Nacional de Planeaci&oacute;n', 2, 32, 1, 1, 5, 2, '899999011', 27, 'DNP', '5713815000', '', '', '', 'https://www.dnp.gov.co', 'Calle 26 # 13 - 19 Edificio Fonade', 33, 3, '', 'El DNP es una entidad eminentemente t&eacute;cnica que impulsa la implantaci&oacute;n de una visi&oacute;n estrat&eacute;gica del pa&iacute;s en los campos social, econ&oacute;mico y ambiental, a trav&eacute;s del dise&ntilde;o, la orientaci&oacute;n y evaluaci&oacute;n de las pol&iacute;ticas p&uacute;blicas colombianas, el manejo y asignaci&oacute;n de la inversi&oacute;n p&uacute;blica y la concreci&oacute;n de las mismas en planes, programas y proyectos del Gobierno.\r\n\r\n', 'https://www.google.com.co/imgres?imgurl=https%3A%2F%2Fsenabcsc150502.files.wordpress.com%2F2011%2F03%2Flogo_dnp.gif&amp;imgrefurl=https%3A%2F%2Fsenabcsc150502.wordpress.com%2F2011%2F03%2F03%2Fel-departamento-nacional-de-planeacion-dnp%2F&amp;docid=ntJMdn8KAWWtyM&amp;tbnid=60DIbk2oR28o6M%3A&amp;vet=10ahUKEwifuMzrt5PTAhXC1CYKHVq4DGsQMwglKAIwAg..i&amp;w=574&amp;h=174&amp;bih=662&amp;biw=1366&amp;q=departamento%20nacional%20de%20planeacion&amp;ved=0ahUKEwifuMzrt5PTAhXC1CYKHVq4DGsQMwglKAIwAg&amp;iact=mrc&amp;uact=8', 4.6129, -74.0716),
