(28, 'Unidad de Planeaci&oacute;n de Infraestructura de Transporte', 2, 3, 1, 1, 5, 2, '38', 13, 'UPIT', '', '', '', '', '', '', 33, 3, '', 'El principal objetivo de la UPIT es planear el desarrollo de la infraestructura de transporte de manera integral, indicativa, permanente y coordinada con los agentes del sector transporte, para promover la competitividad, conectividad, movilidad y desarrollo en el territorio nacional en materia de infraestructura de transporte, as&iacute; como consolidar y divulgar la informaci&oacute;n requerida para la formulaci&oacute;n de pol&iacute;ticas en materia de infraestructura de transporte\r\n', 'http://www.despachospublicos.com/sites/default/files/dpc_logo.jpg', 0, 0),
(29, 'Agencia Nacional de Seguridad Vial', 2, 7, 2, 1, 5, 2, '37', 13, '', '', '', '', '', '', '', 33, 3, '', 'La Agencia Nacional de Seguridad Vial (ANSV) es la m&aacute;xima autoridad para la aplicaci&oacute;n de las pol&iacute;ticas y medidas de seguridad vial nacional, encargada de coordinar los organismos y entidades p&uacute;blicas y privadas comprometidas con la seguridad vial e implementar el plan de acci&oacute;n de la seguridad vial del Gobierno.\r\n\r\n', 'http://ansv.gov.co/wp-content/uploads/2016/08/Screen-Shot-2016-08-20-at-22.27.32.png', 4.64525, -74.1027),
(30, 'Agencia Nacional de Infraestructura', 2, 10, 1, 1, 5, 2, '830125996', 13, 'ANI', '5713791720', '', '', '', 'http://ani.gov.co/', 'Calle 24A # 59 - 42 Edificio T3 Torre 4 Piso 2. Ciudadela Empresarial Sarmiento Angulo', 33, 3, 'Lu&iacute;s Fernando Andrade', 'La Agencia Nacional de Infraestructura - ANI, es una Agencia Nacional Estatal de Naturaleza Especial, del sector descentralizado de la Rama Ejecutiva del Orden Nacional, con personer&iacute;a jur&iacute;dica, patrimonio propio y autonom&iacute;a administrativa, financiera y t&eacute;cnica, adscrita al Ministerio de Transporte, seg&uacute;n decreto 4165 del 03 noviembre de 2011.\r\n\r\n', 'https://www.ani.gov.co/sites/all/themes/bootstrap_ani/logo.png', 4.64315, -74.0975),
(31, 'Comisi&oacute;n de Regulaci&oacute;n de Infraestructura de Transporte', 2, 3, 1, 1, 5, 2, '39', 13, 'CRIT', '', '', '', '', '', '', 33, 3, '', 'El objetivo principal de la CRIT es el dise&ntilde;o y definici&oacute;n del marco de regulaci&oacute;n econ&oacute;mica de los servicios de transporte y de la infraestructura de transporte, cuando se presenten fallas de mercado, para fomentar la eficiencia, promover la competencia, controlar los monopolios y evitar el abuso de posici&oacute;n dominante\r\n\r\n', '', 0, 0),
(32, 'Instituto Nacional de V&iacute;as', 2, 7, 2, 1, 5, 2, '800215807', 13, 'INVIAS', '5717056000', '', '', '5717056000', 'http://www.invias.gov.co/', 'Carrera 59 # 26 - 60', 33, 3, 'Carlos Alberto Garc&iacute;a', 'El Instituto Nacional de V&iacute;as, Inv&iacute;as, tendr&aacute; como objeto la ejecuci&oacute;n de las pol&iacute;ticas, estrategias, planes, programas y proyectos de la infraestructura no concesionada de la Red Vial Nacional de carreteras primaria y terciaria, f&eacute;rrea, fluvial y de la infraestructura mar&iacute;tima, de acuerdo con los lineamientos dados por el Ministerio de Transporte.\r\n\r\n\r\n', 'https://www.invias.gov.co/images/0logo.png', 4.64713, -74.0969),
(33, 'Unidad Administrativa Especial de Aeron&aacute;utica Civil', 2, 3, 1, 1, 5, 2, '899999059', 13, 'AEROCIVIL', '', '', '', '', 'https://www.aerocivil.gov.co/', '', 33, 3, 'Gustavo Alberto Lenis', 'La Unidad Administrativa Especial de Aeron&aacute;utica Civil (Aerocivil) es una entidad especializada, de car&aacute;cter t&eacute;cnico, adscrita al Ministerio de Transporte. Su funci&oacute;n consiste en regular la navegaci&oacute;n y el espacio a&eacute;reo de Colombia, adem&aacute;s de administrar la infraestructura aeroportuaria y aeron&aacute;utica del pa&iacute;s. Aerocivil tambi&eacute;n administra el uso del espacio a&eacute;reo colombiano por parte de la aviaci&oacute;n civil e igualmente controla y vigila la seguridad operacional del sector aeroespacial.\r\n\r\n\r\n\r\n', 'http://www.aerocivil.gov.co/Logos%20encabezado%20master/logo-aeronautica.svg', 4.69798, -74.1406),
(34, 'Superintendencia de Puertos y Transporte', 2, 50, 2, 1, 5, 2, '800170433', 13, 'SUPERTRANSPORTE', '5713526700', '', '', '', 'http://www.supertransporte.gov.co/', 'Calle 63 # 9A - 45 Pisos 2 y 3', 33, 3, 'Javier Antonio Jaramillo', 'La Superintendencia de Puertos y Transporte vigila, inspecciona y controla la prestaci&oacute;n del servicio p&uacute;blico de transporte mar&iacute;timo, fluvial, terrestre, f&eacute;rreo y a&eacute;reo en el pa&iacute;s, en cuanto a lo que calidad de infraestructura y prestaci&oacute;n del servicio se refiere.\r\n\r\n\r\n\r\n', 'http://www.redconsumidor.gov.co/publicaciones/info/sic/media/img72604.png', 4.64914, -74.062),
(35, 'Comisi&oacute;n de Regulaci&oacute;n de Agua Potable y Saneamiento B&aacute;sico', 2, 3, 1, 1, 5, 2, '830000212', 14, 'CRA', '5714873820', '5714897640', '', '5714897650', 'http://www.cra.gov.co/', 'Carrera 12 # 97 - 80, Piso 2', 33, 3, 'Julio C&eacute;sar Aguilera', 'La Comisi&oacute;n de Regulaci&oacute;n de Agua Potable y Saneamiento B&aacute;sico- CRA es una entidad de orden nacional, encargada de regular los servicios p&uacute;blicos domiciliarios de acueducto, alcantarillado y aseo, para mejorar las condiciones del mercado y contribuir al bienestar de la poblaci&oacute;n colombiana.\r\n', 'http://cra.gov.co/apc-aa-files/434f4e46494755524143494f4e5f454e/logooficialcralr_1.jpg', 0, -74.0462),
(36, 'Fondo Nacional de Ahorro', 2, 13, 2, 1, 5, 2, '899999284', 14, 'FNA', '5713077070', '', '', '', 'http://www.fna.gov.co/', 'Carrera 65 # 11 - 83 Puente Aranda', 33, 3, 'Augusto Posada', 'En el Fondo Nacional del Ahorro trabajamos arduamente para hacer realidad los sue&ntilde;os de nuestros afiliados, en vivienda y educaci&oacute;n, A trav&eacute;s de la correcta planeaci&oacute;n buscamos una perfecta ejecuci&oacute;n de nuestras metas en pro de nuestros afiliados.â€‹\r\n\r\n', 'https://www.fna.gov.co/Style%20Library/fna/img/logo-fna.svg', 4.63241, -74.1165),
(37, 'Corporaci&oacute;n Para el Desarrollo Sostenible de la Mojana y el San Jorge', 5, 31, 2, 1, 5, 2, '823000077', 14, 'CORPOMOJANA', '5752954877', '', '', '5752955477', 'http://www.corpomojana.gov.co/', 'Carrera 21 # 21A - 44', 28, 977, '', 'La corporaci&oacute;n aportar&aacute;, con sentido de pertenencia regional, su capacidad humana y t&eacute;cnica en la conservaci&oacute;n y aprovechamiento sostenible de los recursos naturales de la Mojana y el San Jorge, mediante investigaci&oacute;n cient&iacute;fica y transferencia de tecnolog&iacute;a, ejerciendo la autonom&iacute;a dada por la ley 99 de 1993.\r\n\r\n\r\n', 'http://www.despachospublicos.com/sites/default/files/dpc_logo.jpg', 8.66335, -75.1346),
(38, 'Instituto de Evaluaci&oacute;n Tecnol&oacute;gica en Salud', 2, 7, 2, 1, 5, 2, '34', 17, 'IETS', '', '', '', '', 'http://www.iets.org.co/', '', 28, 977, '', '\r\nEl Instituto de Evaluaci&oacute;n Tecnol&oacute;gica en Salud (IETS) es una corporaci&oacute;n sin &aacute;nimo de lucro, de participaci&oacute;n mixta y de car&aacute;cter privado, con patrimonio propio, creado seg&uacute;n lo estipulado en la Ley 1438 de 2011. Sus miembros son el Ministerio de Salud y Protecci&oacute;n Social, el Invima, el Instituto Nacional de Salud, Colciencias, Ascofame y la Asociaci&oacute;n Colombiana de Sociedades Cient&iacute;ficas.&nbsp;\r\n\r\n\r\n', 'http://www.iets.org.co/_catalogs/masterpage/images/logo-IETS.png', 4.68081, -74.0625),
(39, 'Empresa Social del Estado Centro Dermatol&oacute;gico Federico Lleras Acosta', 2, 18, 2, 1, 5, 2, '800247350', 17, '', '5713077072', '', '', '', 'http://www.dermatologia.gov.co/', 'Avenida 1A # 13A - 61', 33, 3, '', 'El centro dermatol&oacute;gico Federico Lleras Acosta busca Brindar, con calidad humana y seguridad, servicios especializados en dermatolog&iacute;a. Realizar formaci&oacute;n, educaci&oacute;n e investigaci&oacute;n en las &aacute;reas de su competencia.  Asesorar al gobierno nacional en la planeaci&oacute;n y ejecuci&oacute;n de estrategias para la promoci&oacute;n de la salud, la prevenci&oacute;n y el control de las patolog&iacute;as cut&aacute;neas, en el marco de la responsabilidad social.\r\n\r\n\r\n', 'http://www.dermatologia.gov.co/_templates/Default/recursos/images/logo_dermatologico.png', 4.59161, -74.0889),
(40, 'Caja de Previsi&oacute;n Social de Comunicaciones', 2, 13, 2, 1, 5, 2, '899999826', 17, 'CAPRECOM', '5712943333', '', '', '5712943925', 'http://www.caprecom.gov.co/', 'Carrera 69 # 47 - 34', 33, 3, '', '\r\n\r\n', 'http://www.despachospublicos.com/sites/default/files/dpc_logo.jpg', 4.65988, -74.104),
(41, 'Fondo de Pasivo Social de Ferrocarriles Nacionales de Colombia', 2, 7, 2, 1, 5, 2, '800112806', 17, 'FPS', '571476775', '5713817171', '', '', 'http://www.fps.gov.co/', '', 33, 3, '', '\r\nEl Fondo de Pasivo Social de Ferrocarriles Nacionales de Colombia como establecimiento p&uacute;blico del orden Nacional, adscrito al Ministerio de Salud y Protecci&oacute;n Social, reconoce prestaciones econ&oacute;micas legales y convencionales a los extrabajadores, pensionados y beneficiarios de las liquidadas empresas Ferrocarriles Nacionales de Colombia y ALCALIS. As&iacute; mismo, administramos los servicios de salud a los pensionados y beneficiarios de la empresa liquidada Ferrocarriles Nacionales y Puertos de Colombia. Contamos con la infraestructura tecnol&oacute;gica y el talento humano calificado y comprometido para brindar una excelente prestaci&oacute;n de nuestros servicios con calidad y transparencia.\r\n', 'http://www.fps.gov.co/inicio/imagenes/top_portada1.jpg', 4.60703, -74.0835),
(42, 'Fondo de Previsi&oacute;n Social del Congreso de la Rep&uacute;blica', 2, 7, 2, 1, 5, 2, '899999734', 17, 'FONPRECON', '5713415566', '5713415556', '5713415696', '5712861853', 'http://www.fonprecon.gov.co/', 'Carrera 10 # 24 - 55 pisos 2 y 3 Edificio World Service', 33, 3, '', 'FONPRECON, como administradora de pensiones del r&eacute;gimen de prima media con prestaci&oacute;n definida gestiona los recursos y la informaci&oacute;n necesaria para decidir el reconocimiento y pago de las prestaciones econ&oacute;micas de sus afiliados, de acuerdo con la normatividad vigente, en el marco del sistema de gesti&oacute;n de calidad, mediante procesos eficientes y la competencia de su talento humano.\r\n', 'http://fonprecon.gov.co/apc-aa-files/434f4e46494755524143494f4e5f454e/Generica1.jpg', 4.61129, -74.0714);
