(43, 'Instituto de Seguros Sociales- En Liquidaci&oacute;n', 2, 13, 2, 1, 5, 2, '860013816', 17, 'ISS', '', '', '', '', '', '', 33, 3, '', 'FONPRECON, como administradora de pensiones del r&eacute;gimen de prima media con prestaci&oacute;n definida gestiona los recursos y la informaci&oacute;n necesaria para decidir el reconocimiento y pago de las prestaciones econ&oacute;micas de sus afiliados, de acuerdo con la normatividad vigente, en el marco del sistema de gesti&oacute;n de calidad, mediante procesos eficientes y la competencia de su talento humano.\r\n', '', 4.62161, -74.0804),
(44, 'Instituto Nacional de Cancerolog&iacute;a, Empresa Social del Estado', 2, 18, 2, 1, 5, 2, '899999092', 17, '', '5713341111', '5715930310', '', '5713341122', 'http://www.cancer.gov.co/', 'Calle 1 # 9 - 85', 33, 3, '', 'Somos una instituci&oacute;n del estado Colombiano en su orden nacional, que trabaja por el control integral del c&aacute;ncer a trav&eacute;s de la atenci&oacute;n y el cuidado de pacientes, la investigaci&oacute;n, la formaci&oacute;n de talento humano y el desarrollo de acciones en salud p&uacute;blica.\r\n\r\n', 'http://www.cancer.gov.co/sites/default/files/images/logopros_292_102.png', 4.5889, -74.0843),
(45, 'Instituto Nacional de Salud', 2, 42, 2, 1, 5, 2, '899999403', 17, 'INS', '5712207700', '', '', '5712200901', 'http://www.ins.gov.co/', 'Avenida calle 26 # 51 - 20 - Zona 6 CAN', 33, 3, '', 'El Instituto Nacional de Salud tendr&aacute; como objeto: (i) el desarrollo y la gesti&oacute;n del conocimiento cient&iacute;fico en salud y biomedicina para contribuir a mejorar las condiciones de salud de las personas; (ii) realizar investigaci&oacute;n cient&iacute;fica b&aacute;sica y aplicada en salud y biomedicina; (iii) la promoci&oacute;n de la investigaci&oacute;n cient&iacute;fica, la innovaci&oacute;n y la formulaci&oacute;n de estudios de acuerdo con las prioridades de salud p&uacute;blica de conocimiento del Instituto; (iv) la vigilancia y seguridad sanitaria en los temas de su competencia; la producci&oacute;n de insumos biol&oacute;gicos; y (v) actuar como laboratorio nacional de referencia y coordinador de las redes especiales, en el marco del Sistema General de Seguridad Social en Salud y del Sistema de Ciencia. Tecnolog&iacute;a e Innovaci&oacute;n.\r\n\r\n\r\n', 'http://www.ins.gov.co/Style%20Library/INS/Images/logo_INS.png', 4.64122, -74.0951),
(46, 'Instituto Nacional de Vigilancia de Medicamentos y Alimentos', 2, 7, 2, 1, 5, 2, '830000167', 17, 'INVIMA', '5712948700', '', '', '', 'https://www.invima.gov.co/', 'Carrera 10 # 64 - 28', 33, 3, '', 'El instituto Nacional de Vigilancia de medicamentos y alimentos busca Proteger y promover la salud de la poblaci&oacute;n, mediante la gesti&oacute;n del riesgo asociada al consumo y uso de alimentos, medicamentos,  dispositivos m&eacute;dicos y otros productos objeto de vigilancia sanitaria.\r\n\r\n\r\n\r\n', '2wCEAAkGBxIRDxMRERMWFRESFxcVFhYYFRYTFxgVFhYWFxUYGBMZHyggGBoxGxcTITEhJSkrLi4uFx8zRDMtNygtLisBCgoKDg0OGhAQGy0lICY1LS8tNS8tLTg2Ky0tMjAtLS0vMC0tLS4tLS8tLS0tLS0tLS0tLy0tLS0tLS0vLy0yLf', 4.65007, -74.0617),
(47, 'Sanatorio de Agua de Dios, Empresa Social del Estado', 2, 18, 2, 1, 5, 2, '890680014', 17, '', '', '', '', '', 'http://www.sanatorioaguadedios.gov.co/', 'Carrera 11 # 21 - 108', 14, 485, '', 'Somos el Sanatorio de Agua de Dios Empresa Social del Estado, del orden nacional, instituci&oacute;n prestadora de servicios de salud de baja complejidad a pacientes Hansen y dem&aacute;s poblaci&oacute;n, ejecutamos actividades de docencia, investigaci&oacute;n y capacitaci&oacute;n en enfermedades de salud p&uacute;blica, con un talento humano que brinda seguridad, humanizaci&oacute;n, calidad y calidez en el proceso de atenci&oacute;n al paciente y su familia.\r\n\r\n\r\n\r\n', 'http://www.sanatorioaguadedios.gov.co/images/logos/logo_sanatorioa_v2.jpg', 4.37049, -74.6741),
(48, 'Sanatorio de Contrataci&oacute;n, Empresa Social del Estado', 2, 18, 2, 1, 5, 2, '890205335', 17, '', '5777171365', '', '', '5777171200', 'http://www.sanatoriocontratacion.gov.co/', 'Calle 3 # 2 - 72', 27, 895, '', 'Somos una Empresa Social del Estado del orden Nacional, especializada en el manejo integral de los pacientes de Hansen, orientada a la prestaci&oacute;n de servicios de salud con calidad t&eacute;cnico&ndash;cient&iacute;fica, segura y humanizada, con talento humano comprometido en la optimizaci&oacute;n de los procesos, en procura del mejoramiento de la calidad de vida de los usuarios y sus familias\r\n', '', 6.69763, -73.5114),
(49, 'Superintendencia Nacional de Salud', 2, 49, 2, 1, 5, 2, '860062187', 17, 'SUPERSALUD', '5714837000', '', '', '', 'http://www.supersalud.gov.co/', 'Avenida Ciudad de Cali # 51 - 66', 33, 3, '', 'La superintendencia nacional de salud busca Proteger los derechos de los usuarios del Sistema General de Seguridad Social en Salud mediante la inspecci&oacute;n, vigilancia, control y el ejercicio de la funci&oacute;n jurisdiccional y de conciliaci&oacute;n, de manera transparente y oportuna.\r\n\r\n', 'https://assets.supersalud.gov.co/SiteCollectionImages/logo-supersalud.png', 4.68084, -74.1171),
(50, 'Empresa de Telecomunicaciones de Bucaramanga', 2, 13, 2, 1, 5, 2, '890201210', 12, 'TELEBUCARAMANGA', '', '', '', '', 'http://www.telebucaramanga.com.co/', '', 27, 873, '', 'Telebucaramanga es la primera compa&ntilde;&iacute;a de telefon&iacute;a de Bucaramanga y su &Aacute;rea Metropolitana. Hoy como empresa de telecomunicaciones presta los servicios de Telefon&iacute;a fija, Internet Banda Ancha y TV Digital Satelital a hogares y pymes siendo la compa&ntilde;&iacute;a l&iacute;der en participaci&oacute;n del mercado local de Telefon&iacute;a e Internet.\r\n\r\n\r\n', 'https://www.telebucaramanga.com.co/sites/all/themes/tele/logo.png', 7.11775, -73.1267),
(51, 'Agencia Nacional del Espectro', 2, 3, 1, 1, 5, 2, '900334265', 12, 'ANE', '5716000030', '', '', '5716000090', 'http://www.ane.gov.co/', 'Calle 93 # 17 - 45, Pisos 4, 5 y 6', 33, 3, 'Oscar Giovanni Le&oacute;n', 'La agencia nacional del espectro busca Realizar la planeaci&oacute;n, atribuci&oacute;n, vigilancia y control del Espectro Radioel&eacute;ctrico en Colombia, as&iacute; como brindar la asesor&iacute;a t&eacute;cnica para la gesti&oacute;n eficiente del mismo y fomentar su conocimiento.\r\n\r\n\r\n', 'https://lh5.googleusercontent.com/proxy/MkVr8Rmr3PUhTx3RcxvMFfAAYp1dyEWMMCLF4bQvwZftIAfaEe5ZIYL3zVLJINqxBOvpJ_Yc6_ofdbk8zFAQzziB64wLBV362Y2qu9IbJZxsv1LuYwIYiipPIbaEoFVwH8QOLHoEn6KukUbZw1AJG4AkamKAH5M=w160-h160', 4.67768, -74.0537),
