(54, 'Comisi&oacute;n de Regulaci&oacute;n de Comunicaciones', 2, 8, 1, 1, 5, 2, '830002593', 12, 'CRC', '5713198300', '', '', '5713198301', 'https://www.crcom.gov.co', 'Calle 59A bis # 5 - 53 Edificio LINK Siete Sesenta Piso 9', 33, 3, '', 'La Comisi&oacute;n de Regulaci&oacute;n de Comunicaciones promueve la interacci&oacute;n y el empoderamiento de los agentes del ecosistema digital para maximizar el bienestar social. El compromiso de la CRC con el Sistema Integral de Gesti&oacute;n se enfoca en el mejoramiento continuo de los procesos y de los productos, con el fin de maximizar el bienestar social y atender las necesidades del sector de las Tecnolog&iacute;as de la Informaci&oacute;n y las Comunicaciones de manera eficaz eficiente y efectiva, enmarcados dentro del prop&oacute;sito superior y la misi&oacute;n y la visi&oacute;n institucional.\r\n\r\n\r\n\r\n', 'https://lh6.googleusercontent.com/proxy/xqh4CNKXwNvySUUUCnDL3fNIHO6ICjML53LTy8dx9f6mKyAVFrff09e4RqRq3dUD80nH7BNUp2HtK7vnnVmG2JKHv3wgvJ3FNl-e6sV9Zgkl6C1SQ1V5XXY91QcuCcCgw-02zWY7rkEWL5hnORSJRgfiSw=w240-h160', 4.64491, -74.0612),
