(56, 'Metropolitana de Telecomunicaciones S.A. Especial', 2, 11, 2, 1, 5, 2, '800204278', 12, 'METROTEL', '', '', '', '', 'http://www.metrotel.com.co/', '', 4, 138, '', 'Somos una empresa reconocida en la Costa Caribe por sus m&aacute;s de 20 a&ntilde;os en el mercado l&iacute;der en ofrecer soluciones integrales en telecomunicaciones, con un talento humano local que nos permite  tener un conocimiento m&aacute;s amplio de nuestros usuarios. Somos tecnol&oacute;gicos, innovadores y de tradici&oacute;n en la regi&oacute;n.\r\n\r\n\r\n\r\n\r\n', 'https://www.metrotel.com.co/sites/default/files/metrotel-logo_0.png', 11.0023, -74.8004),
(57, 'Servicios Postales Nacionales S.A.', 2, 13, 2, 1, 5, 2, '900062917', 12, '', '5714722005', '', '', '', 'http://www.4-72.com.co/', 'Diagonal 25G # 95A - 55', 33, 3, '', '4-72 es la empresa oficial de correo de Colombia que nos permite a todos enviar cartas y paquetes a personas dentro y fuera del pa&iacute;s. &iquest;Por qu&eacute; nos llamamos 4-72? Porque esa es la posici&oacute;n de Colombia en la tierra. Si miramos la l&iacute;nea del Ecuador, aquella que divide imaginariamente el planeta en dos, estamos 4 grados por encima de esa l&iacute;nea y 72 grados a la derecha. Ese punto espec&iacute;fico es el centro de nuestro pa&iacute;s.\r\n', 'http://www.4-72.com.co/sites/all/themes/nexus/logo.png', 4.67996, -74.1226),
(58, 'Sociedad Radio Televisi&oacute;n Nacional de Colombia', 2, 13, 2, 1, 5, 2, '900002583', 12, 'RTVC', '5712200700', '', '', '', 'http://www.sistemasenalcolombia.gov.co/', 'Avenida El Dorado Carrera 45 # 26 - 33', 33, 3, 'John Jairo Ocampo', 'Somos una empresa que gestiona contenidos de calidad y garantiza su disponibilidad y circulaci&oacute;n, con el prop&oacute;sito de formar, informar, entretener y fortalecer la  ciudadan&iacute;a.\r\n\r\n', 'data:image/jpeg;base64,', 4.65936, -74.1082),
