(61, 'Administradora Colombiana de Pensiones', 2, 13, 2, 1, 5, 2, '900336004', 16, 'COLPENSIONES', '5712170100', '', '', '', 'http://www.colpensiones.gov.co/', 'Carrera 10 # 72 - 33 Torre B Piso 11', 33, 3, 'Jorge Alberto Silva', 'La Administradora Colombiana de Pensiones, COLPENSIONES, es una Empresa Industrial y Comercial del Estado organizada como entidad financiera de car&aacute;cter especial, vinculada al Ministerio de Trabajo.\r\n', 'data:image/png;base64,', 4.65702, -74.0576),
(62, 'Unidad Administrativa Especial del Servicio P&uacute;blico de Empleo', 2, 3, 1, 1, 5, 2, '900678508', 16, '', '5714893900', '', '', '', 'http://serviciodeempleo.gov.co/', 'Carrera 69 # 25B - 44 Piso 7', 33, 3, '', '&quot;Somos un equipo de trabajo comprometido con establecer el sistema mediante el cual los trabajadores pueden encontrar un empleo adecuado a su perfil y los empleadores contratar trabajadores apropiados a sus necesidades.\r\nLa Unidad de Servicio P&uacute;blico de Empleo es el medio que hace m&aacute;s eficiente la relaci&oacute;n entre oferta y demanda de trabajo.&quot;\r\n\r\n', 'http://serviciodeempleo.gov.co/img/logo.png', 4.65754, -74.1073),
(63, 'Servicio Nacional de Aprendizaje', 2, 7, 2, 1, 5, 2, '899999034', 16, 'SENA', '5715925555', '', '', '', 'http://www.sena.edu.co/', 'Calle 57 # 8 - 69', 33, 3, '', 'El Servicio Nacional de Aprendizaje - SENA, es un establecimiento p&uacute;blico del orden nacional, con personer&iacute;a jur&iacute;dica, patrimonio propio e independiente, y autonom&iacute;a administrativa;  Adscrito al Ministerio del Trabajo de Colombia. Ofrece formaci&oacute;n gratuita a millones de colombianos que se benefician con programas t&eacute;cnicos, tecnol&oacute;gicos y complementarios que enfocados en el desarrollo econ&oacute;mico, tecnol&oacute;gico y social del pa&iacute;s, entran a engrosar las actividades productivas de las empresas y de la industria, para obtener mejor competitividad y producci&oacute;n con los mercados globalizados.\r\n\r\n\r\n', 'http://www.sena.edu.co/Style%20Library/alayout/images/logoSena.png', 4.64347, -74.0633),
