(65, 'Unidad Administrativa Especial de Organizaciones Solidarias', 2, 3, 1, 1, 5, 2, '899999050', 16, '', '5713275252', '', '', '5713275248', 'http://www.orgsolidarias.gov.co/', 'Carrera 10 # 15 - 22', 33, 3, '', ' Unidad Administrativa Especial de Organizaciones Solidarias busca Promover, fomentar, fortalecer y desarrollar socio-empresarialmente las organizaciones solidarias para generar desarrollo en los sectores y regiones del pa&iacute;s con una institucionalidad del sector fortalecida y transversal.\r\n', 'http://www.orgsolidarias.gov.co/sites/default/files/logo-oss.png', 4.60344, -74.0756),
