(67, 'Unidad Administrativa Especial de Migraci&oacute;n Colombia', 2, 3, 1, 1, 5, 2, '900477235', 11, '', '5716055454', '', '', '', 'http://www.migracioncolombia.gov.co/', 'Calle 26 # 59 - 51 Edificio Argos - Torre 3 Piso 4', 33, 3, '', 'El objetivo de Migraci&oacute;n Colombia, es ejercer las funciones de autoridad de vigilancia y control migratorio y de extranjer&iacute;a del Estado Colombiano, dentro del marco de la soberan&iacute;a nacional y de conformidad con las leyes y la pol&iacute;tica que en la materia defina el Gobierno Nacional.\r\n\r\n', 'http://www.migracioncolombia.gov.co/templates/eva/images/migpais2.png', 4.64653, -74.0985),
