(90, 'Agencia Nacional de Defensa Jur&iacute;dica del Estado', 2, 3, 1, 1, 5, 2, '900507741', 9, '', '5712558955', '', '', '5712558933', 'http://www.defensajuridica.gov.co/', 'Carrera 7 #75 - 66 Piso 2 y 3', 33, 3, '', 'La Agencia est&aacute; adscrita al Ministerio de Justicia y del Derecho, tiene como objetivo la estructuraci&oacute;n, formulaci&oacute;n, aplicaci&oacute;n, evaluaci&oacute;n y difusi&oacute;n de las pol&iacute;ticas de prevenci&oacute;n del da&ntilde;o antijur&iacute;dico, as&iacute; como la defensa y protecci&oacute;n efectiva de los intereses litigiosos de la Naci&oacute;n en las actuaciones judiciales de las entidades p&uacute;blicas, en procura de la reducci&oacute;n de la responsabilidad patrimonial y la actividad litigiosa, cuya misi&oacute;n es planificar, coordinar, ejercer, monitorear y evaluar la defensa efectiva de la Naci&oacute;n, a fin de prevenir el da&ntilde;o antijur&iacute;dico y propender al fomento de los derechos fundamentales.\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.65838, -74.0533),
(91, 'Direcci&oacute;n Nacional de Estupefacientes - En Liquidaci&oacute;n', 2, 3, 1, 1, 5, 2, '800101599', 9, 'DNE', '', '', '', '', '', '', 33, 3, '', 'La Agencia est&aacute; adscrita al Ministerio de Justicia y del Derecho, tiene como objetivo la estructuraci&oacute;n, formulaci&oacute;n, aplicaci&oacute;n, evaluaci&oacute;n y difusi&oacute;n de las pol&iacute;ticas de prevenci&oacute;n del da&ntilde;o antijur&iacute;dico, as&iacute; como la defensa y protecci&oacute;n efectiva de los intereses litigiosos de la Naci&oacute;n en las actuaciones judiciales de las entidades p&uacute;blicas, en procura de la reducci&oacute;n de la responsabilidad patrimonial y la actividad litigiosa, cuya misi&oacute;n es planificar, coordinar, ejercer, monitorear y evaluar la defensa efectiva de la Naci&oacute;n, a fin de prevenir el da&ntilde;o antijur&iacute;dico y propender al fomento de los derechos fundamentales.\r\n\r\n\r\n', 'https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcQ_ZuCRUgsrvD015ERTwclnlE8KQkTZ9Ui4n1GktW2yMxhfrZYh', 4.59243, -74.0882),
(92, 'Instituto Nacional Penitenciario y Carcelario', 2, 7, 2, 1, 5, 2, '800546215', 9, 'INPEC', '5712347474', '5712347262', '', '', 'http://www.inpec.gov.co/', 'Calle 26 # 27 - 48', 33, 3, '', 'El Sistema Nacional Penitenciario y Carcelario est&aacute; integrado por el Instituto Nacional Penitenciario y Carcelario, como establecimiento p&uacute;blico adscrito al &quot;Ministerio de Justicia y del Derecho&quot; con personer&iacute;a jur&iacute;dica, patrimonio independiente y autonom&iacute;a administrativa; por todos los centros de reclusi&oacute;n que funcionan en el pa&iacute;s, por la Escuela Penitenciaria Nacional y por los dem&aacute;s organismos adscritos o vinculados al cumplimiento de sus fines.\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.58927, -74.1107),
(93, 'Superintendencia de Notariado y Registro', 2, 49, 2, 1, 5, 2, '899999007', 9, 'SNR', '5713282121', '', '', '', 'http://www.supernotariado.gov.co/', 'Calle 26 # 13 - 49 Interior 201', 33, 3, '', 'La SNR estandariza y presta el servicio registral a partir de la modernizaci&oacute;n y optimizaci&oacute;n de los procesos administrativos, tecnol&oacute;gicos y humanos con el prop&oacute;sito de ofrecer a los ciudadanos tr&aacute;mites m&aacute;s &aacute;giles y confiables en las Oficinas de Registro de Instrumentos P&uacute;blicos a lo largo de todo el pa&iacute;s. As&iacute; tambi&eacute;n, la Entidad vigila y controla el servicio registral y notarial supervisando la Guarda de la Fe P&uacute;blica, la seguridad jur&iacute;dica de los bienes inmuebles y lidera estrategias para restituir, formalizar y proteger las tierras en Colombia.\r\n\r\n\r\n\r\n\r\n', 'https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcT9hzIjSKETAsKWhg_7SHTycfkQc7-0_vcbrdHAyRFVoP6_5BXOcpkH1afg', 4.61407, -74.0717),
(94, 'Unidad de Servicios Penitenciarios y Carcelarios', 2, 3, 1, 1, 5, 2, '90523392', 9, 'USPEC', '5714864130', '', '', '', 'http://www.uspec.gov.co/', 'Calle 97 A # 9A - 34', 33, 3, '', 'La Unidad de Servicios Penitenciarios y Carcelarios -USPEC, tiene como objetivo gestionar y operar el suministro de bienes y la prestaci&oacute;n de los servicios, la infraestructura y brindar el apoyo log&iacute;stico y administrativo requeridos para el adecuado funcionamiento de los servicios penitenciarios y carcelarios a cargo del Instituto Nacional Penitenciario y Carcelario -INPEC.\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.68017, -74.0432),
(95, 'Direcci&oacute;n Nacional de Bomberos', 2, 3, 1, 1, 5, 2, '900639630', 15, '', '', '', '', '', '', '', 33, 3, '', '\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.67488, -74.0653),
(96, 'Fondo Para la Participaci&oacute;n y el Fortalecimiento de la Democracia', 2, 7, 2, 1, 5, 2, '800011991', 15, '', '', '', '', '', '', '', 33, 3, '', 'El Fondo Para la Participaci&oacute;n y el Fortalecimiento de la Democracia, es un Establecimiento p&uacute;blico del Orden Nacional, sin planta de personal, cuya misi&oacute;n es generar programas que contribuyan y hagan efectiva la participaci&oacute;n ciudadana y el ejercicio de la democracia.\r\n\r\n\r\n\r\n\r\n', 'http://www.despachospublicos.com/sites/default/files/dpc_logo.jpg', 0, 0);
