(97, 'Direcci&oacute;n Nacional de Derecho de Autor', 2, 3, 1, 1, 5, 2, '800185929', 15, 'DNDA', '5713418177', '', '', '5712860813', 'http://www.derechodeautor.gov.co/', 'Calle 28 # 13A - 15 Piso 17', 33, 3, '', 'La Direcci&oacute;n Nacional de Derecho de Autor es un organismo del Estado Colombiano, que posee la estructura jur&iacute;dica de una Unidad Administrativa Especial adscrita al Ministerio del Interior y es el &oacute;rgano institucional que se encarga del dise&ntilde;o, direcci&oacute;n, administraci&oacute;n y ejecuci&oacute;n de las pol&iacute;ticas gubernamentales en materia de derecho de autor y derechos conexos. \r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.61587, -74.0713),
