(99, 'Imprenta Nacional de Colombia', 2, 13, 2, 1, 5, 2, '830001113', 15, '', '5714578000', '', '', '5714578037', 'http://www.imprenta.gov.co/', 'Carrera 66 # 24 - 09 Barrio Salitre', 33, 3, '', 'El objeto de la Imprenta Nacional de Colombia es la edici&oacute;n, dise&ntilde;o, impresi&oacute;n, divulgaci&oacute;n, comercializaci&oacute;n y distribuci&oacute;n de las normas, documentos, pol&iacute;ticas p&uacute;blicas, impresos y publicaciones de las entidades nacionales que integran las ramas del poder p&uacute;blico en Colombia,  para garantizar la seguridad jur&iacute;dica.\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.64847, -74.105),
(100, 'Unidad Nacional de Protecci&oacute;n', 2, 3, 1, 1, 5, 2, '900475780', 15, 'UNP', '5714269800', '', '', '', 'http://www.unp.gov.co/', 'Avenida Calle 26 # 59 - 41/65', 33, 3, '', '\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.63596, -74.1123),
