(104, 'Empresa Colombiana de Productos Veterinarios S.A.', 2, 4, 2, 1, 5, 2, '899999002', 2, 'VECOL', '5714254800', '', '', '5714254835', 'http://www.vecol.com.co/', 'Avenida El dorado 82 &ndash; 93', 33, 3, 'Jos&eacute; Elias Borrero', 'VECOL S.A. tiene como objeto promover y estimular el incremento de la producci&oacute;n agropecuaria y sus insumos, as&iacute; como el mejoramiento de la salud humana y animal, mediante la producci&oacute;n, venta, comercializaci&oacute;n, importaci&oacute;n, exportaci&oacute;n e investigaci&oacute;n cient&iacute;fica de productos biotecnol&oacute;gicos, qu&iacute;micos, farmac&eacute;uticos, agr&iacute;colas e industriales\r\n\r\n\r\n\r\n\r\n\r\n', 'http://www.vecol.com.co/themes/front/img/logo.png', 4.67527, -74.1179),
