(107, 'Almacenes Generales de Dep&oacute;sito de la Caja Agraria y Banco Ganadero S.A.', 2, 4, 2, 1, 5, 2, '899999049', 2, 'ALMAGRARIO S.A.', '5715894000', '', '', '', 'http://www.almagrario.com/', 'Carrera 7 # 71 - 52 Torre A Piso 9', 33, 3, '', 'Almacenes Generales de Dep&Atilde;&sup3;sito de la Caja Agraria y Banco Ganadero S.A. ALMAGRARIO busca Ofrecer soluciones log&iacute;sticas integrales de excelente calidad que permitan, con un capital humano calificado, satisfacer las necesidades de los clientes.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'https://www.almagrario.com/images/logo.png', 4.65439, 0),
(108, 'Autoridad Nacional de Acuicultura y Pesca', 2, 3, 1, 1, 5, 2, '3', 2, 'AUNAP', '5713770500', '', '', '', 'http://www.aunap.gov.co/', 'Calle 40A # 13 - 09 Edificio UGI pisos 6 y 14', 33, 3, 'Otto Polanco', 'Autoridad Nacional de Acuicultura y Pesca se encarga de Ejecutar la pol&iacute;tica pesquera y de la acuicultura en el territorio colombiano con fines de investigaci&oacute;n, ordenamiento, administraci&oacute;n, control y vigilancia de los recursos pesqueros, y de impulso de la acuicultura propendiendo por el desarrollo productivo y  progreso social.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.6278, -74.0672),
(109, 'Banco Agrario de Colombia S.A.', 2, 4, 2, 1, 5, 2, '800037800', 2, 'BANAGRARIO', '5715948500', '', '', '', 'http://www.bancoagrario.gov.co/', 'Carrera 8 # 15 - 42 Piso 9', 33, 3, 'Francisco Solano', 'El Banco Agrario de Colombia es el aliado estrat&eacute;gico de las entidades nacionales y territoriales (municipios, distritos especiales, departamentos y resguardos ind&iacute;genas) y entidades descentralizadas (empresas comerciales e industriales del Estado, empresas de econom&iacute;a mixta y corporaciones aut&oacute;nomas), a trav&eacute;s de un portafolio de productos y servicios financieros que les permitir&aacute; garantizar el manejo eficiente de los recursos orientados al desarrollo de sus proyectos de infraestructura, salud, educaci&oacute;n y muchos m&aacute;s.\r\n', 'data:image/jpeg;base64,', 4.60231, -74.0744),
(110, 'Caja de Compensaci&oacute;n Familiar Campesina', 2, 20, 2, 1, 5, 2, '800231969', 2, 'COMCAJA', '5716353511', '', '', '5716356615', 'http://www.comcaja.gov.co/', 'Carrera 12 # 96-23/37', 33, 3, 'Felipe S&aacute;nchez', 'La Caja de Compensaci&oacute;n Familiar Campesina COMCAJA, fue creada mediante Ley 101 de 1.993 como una corporaci&oacute;n de subsidio familiar y como persona jur&iacute;dica sin &aacute;nimo de lucro, perteneciente al sector agropecuario y vinculada al Ministerio de Agricultura; cuenta con presencia en 4 departamentos y, en el resto del pais, ofrece los servicios mediante convenios Intercajas.\r\n', 'data:image/jpeg;base64,', 4.68042, -74.047),
(111, 'Central de Abastos de C&uacute;cuta S.A.', 2, 4, 2, 1, 5, 2, '890503614', 2, 'CENABASTOS', '5775877273', '5775874687', '', '5775739527', 'http://www.cenabastos.gov.co/', 'Avenida 2 # 31N &ndash; 36 Oficina T&ndash;208', 22, 792, '', 'CENABASTOS S.A. es una Sociedad de econom&iacute;a mixta del orden nacional, vinculada al Ministerio de Agricultura y Desarrollo Rural, que en virtud a que el Estado tiene m&aacute;s del 90% del capital social, se le aplican las normas que corresponden a las Empresas Industriales y Comerciales del Estado.\r\n\r\n', 'https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcQNow2psWrx8UEoZzxe-83J5dsWaNSJkhRQvyybyk3o41Rn7mFn4A', 7.92947, -72.505),
(112, 'Corporaci&oacute;n Colombia Internacional', 2, 34, 2, 1, 5, 2, '800186585', 2, 'CCI', '5713443111', '', '', '', 'http://www.cci.org.co/', 'calle 16 # 6 - 66 &nbsp;- piso 7&deg;', 33, 3, '', 'La CORPORACI&Oacute;N COLOMBIA INTERNACIONAL - CCI promueve la reconversi&oacute;n agropecuaria colombiana con herramientas propias, mediante los MACS - Modelos Agroempresariales Competitivos y Sostenibles-  demostrando el verdadero desarrollo rural integral que mejora los ingresos de la cadena de valor de la agricultura y agroindustria nacional, respondiendo a las necesidades del mercado.\r\n\r\n', 'data:image/png;base64,', 4.6025, -74.0725);
