(113, 'Corporaci&oacute;n Colombiana de Investigaci&oacute;n Agropecuaria', 2, 34, 2, 1, 5, 2, '800194600', 2, 'CORPOICA', '5714227300', '', '', '5712227300', 'http://www.corpoica.org.co/', 'Km 14 V&iacute;a Mosquera Cundinamarca', 33, 3, 'Juan Lucas Restrepo', 'La Corporaci&oacute;n Colombiana de Investigaci&oacute;n Agropecuaria, Corpoica, es una entidad p&uacute;blica descentralizada de participaci&oacute;n mixta sin &aacute;nimo de lucro, de car&aacute;cter cient&iacute;fico y t&eacute;cnico, cuyo objeto es desarrollar y ejecutar actividades de Investigaci&oacute;n, Tecnolog&iacute;a y transferir procesos de Innovaci&oacute;n tecnol&oacute;gica al sector agropecuario\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.69537, -74.2042),
