(115, 'Corporaci&oacute;n de Abastos de Bogot&aacute; S.A.', 2, 13, 2, 1, 5, 2, '860028093', 2, 'CORABASTOS', '5714537188', '', '', '', 'http://www.corabastos.com.co/', 'Avenida Carrera 80 # 2 - 51', 33, 3, '', 'Como principal plataforma de abastecimiento del pa&iacute;s, CORABASTOS ofrece servicios especializados a los participantes de la cadena agroalimentaria, con una infraestructura adecuada y cobertura nacional en la comercializaci&oacute;n de alimentos en el canal tradicional.\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.6287, -74.1596),
