(125, 'Fondo Para el Financiamiento del Sector Agropecuario', 2, 4, 2, 1, 5, 2, '800116398', 2, 'FINAGRO', '5713203377', '', '', '5713380197', 'https://www.finagro.com.co/', 'Carrera 13 # 28 - 17 pisos 2,3,4 y 5', 33, 3, 'Luis Eduardo G&oacute;mez', 'FINAGRO, El Fondo para el Financiamiento del Sector Agropecuario, es una entidad que promueve el desarrollo del sector rural colombiano, con instrumentos de financiamiento y desarrollo rural, que estimulan la inversi&oacute;n. Es una sociedad de econom&iacute;a mixta del orden nacional, organizada como establecimiento de cr&eacute;dito, con r&eacute;gimen especial, vinculada al Ministerio de Agricultura y Desarrollo Rural y vigilado por la Superintendencia Financiera de Colombia.\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.616, -74.0696),
(126, 'Instituto Colombiano Agropecuario', 2, 7, 2, 1, 5, 2, '899999069', 2, 'ICA', '5713323700', '', '', '5712884800', 'http://www.ica.gov.co/', 'Carrera 41 # 17 - 81', 33, 3, 'Luis Humberto Mart&iacute;nez', 'El Instituto Colombiano Agropecuario, Ica, tiene por objeto contribuir al desarrollo sostenido del sector agropecuario, pesquero y acu&iacute;cola, mediante la prevenci&oacute;n, vigilancia y control de los riesgos sanitarios, biol&oacute;gicos y qu&iacute;micos para las especies animales y vegetales, la investigaci&oacute;n aplicada y la administraci&oacute;n, investigaci&oacute;n y ordenamiento de los recursos pesqueros y acu&iacute;colas, con el fin de proteger la salud de las personas, los animales y las plantas y asegurar las condiciones del comercio.\r\n\r\n\r\n\r\n\r\n', 'http://www.ica.gov.co/App_Themes/ICA2014/imagenes/LogoICA.png', 4.62336, -74.0971);
