(127, 'Instituto Colombiano de Desarrollo Rural', 2, 7, 2, 1, 5, 2, '830122398', 2, 'INCODER', '5713830444', '', '', '5713830444', 'http://www.incoder.gov.co/', 'Calle 43 # 57 - 41', 33, 3, 'Rey Ariel Borb&oacute;n', '\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.64636, -74.0955),
(128, 'Sociedad Fiduciaria de Desarrollo Agropecuario S.A.', 2, 4, 2, 1, 5, 2, '80015998', 2, 'FIDUAGRARIA', '5715606100', '', '', '5715616080', 'http://www.fiduagraria.gov.co/', 'Calle 16 # 6 - 66 Pisos 26, 28 y 29', 33, 3, 'Luis Fernando Cr&uacute;z', 'Somos una sociedad de servicios financieros que contribuye al desarrollo econ&oacute;mico y social del pa&iacute;s, que ofrece productos y servicios a la medida, veh&iacute;culo en la ejecuci&oacute;n de pol&iacute;ticas p&uacute;blicas e iniciativas privadas, para contribuir al crecimiento sostenible del sector rural. Contamos con procesos &aacute;giles y eficientes y profesionales expertos, prudentes y diligentes, para satisfacer las expectativas de nuestros grupos de inter&eacute;s.\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.6025, -74.0725),
(129, 'Unidad Administrativa Especial de Gesti&oacute;n de Restituci&oacute;n de Tierras Despojadas', 2, 3, 1, 1, 5, 2, '4', 2, 'URT', '5713770300', '', '', '', 'https://www.restituciondetierras.gov.co/', 'Calle 72 # 11 - 81 / 85 Primer Piso', 33, 3, 'Jes&uacute;s Ricardo Sabogal', 'La Unidad Administrativa Especial de Gesti&oacute;n de Restituci&oacute;n de Tierras Despojadas tendr&aacute; como objetivo fundamental servir de &oacute;rgano administrativo del Gobierno Nacional para la restituci&oacute;n de tierras de los despojados a que se refiere la presente ley.\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.65773, -74.0598),
(130, 'Unidad de Planificaci&oacute;n de Tierras Rurales, Adecuaci&oacute;n de Tierras y Usos Agropecuarios', 2, 8, 1, 1, 5, 2, '900479658', 2, 'UPRA', '5715529820', '5712457307', '', '', 'http://www.upra.gov.co/', 'Calle 35 # 5 - 81', 33, 3, 'Felipe Fonseca', 'Unidad de Planificaci&ograve;n de Tierras Rurales, Adecuacion de Tierras y Usos Agropecuarios, UPRA se encarga de Orientar la formulaci&oacute;n, ejecuci&oacute;n, seguimiento y evaluaci&oacute;n  de la pol&iacute;tica de gesti&oacute;n del territorio para usos agropecuarios, a trav&eacute;s de la planificaci&oacute;n del ordenamiento productivo y social de la propiedad, y la definici&oacute;n de lineamientos, criterios e instrumentos, que promuevan el uso eficiente del suelo para el desarrollo rural con enfoque territorial.\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.61599, -74.0704),
(131, 'Autoridad Nacional de Licencias Ambientales', 2, 8, 1, 1, 5, 2, '900467239', 3, 'ANLA', '5712540111', '', '', '5712540119', 'http://www.anla.gov.co/', 'Calle 37 # 8 - 40', 33, 3, 'Fernando Iregui', 'La Autoridad Nacional de Licencias Ambientales ANLA es la encargada de que los proyectos, obras o actividades sujetos de licenciamiento, permiso o tr&aacute;mite ambiental cumplan con la normativa ambiental, de tal manera que contribuyan al desarrollo sostenible del Pa&iacute;s.\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.62502, -74.0671);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(132, 'Instituto Amaz&oacute;nico de Investigaciones Cient&iacute;ficas', 2, 34, 2, 1, 5, 2, '860061110', 3, 'SINCHI', '5785925481', '5785925479', '', '5785928171', 'http://www.sinchi.org.co/', 'Avenida V&aacute;squez Cobo entre calles 15 y 16', 33, 3, 'Luz Marina Mantilla', '\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.60808, -74.0733),
(133, 'Instituto de Hidrolog&iacute;a, Meteorolog&iacute;a y Estudios Ambientales', 2, 7, 2, 1, 5, 2, '830000602', 3, 'IDEAM', '5713527160', '', '', '', 'http://institucional.ideam.gov.co/', 'Calle 25D # 96B - 70', 33, 3, 'Omar Franco', 'El IDEAM es una instituci&oacute;n p&uacute;blica de apoyo t&eacute;cnico y cient&iacute;fico al Sistema Nacional Ambiental, que genera conocimiento, produce informaci&oacute;n confiable, consistente y oportuna, sobre el estado y las din&aacute;micas de los recursos naturales y del medio ambiente, que facilite la definici&oacute;n y ajustes de las pol&iacute;ticas ambientales y la toma de decisiones por parte de los sectores p&uacute;blico, privado y la ciudadan&iacute;a en general.\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.61663, -74.0731),
(134, 'Instituto de Investigaci&oacute;n de Recursos Biol&oacute;gicos Alexander Von Humboldt', 2, 34, 2, 1, 5, 2, '820000142', 3, '', '5713202767', '', '', '', 'http://www.humboldt.org.co/', 'CALLE 28A # 15 - 09', 33, 3, 'Brigitte LG Baptiste', 'La misi&oacute;n del Instituto Humboldt es promover, coordinar y realizar investigaci&oacute;n que contribuya al conocimiento, la conservaci&oacute;n y el uso sostenible de la biodiversidad como un factor de desarrollo y bienestar de la poblaci&oacute;n colombiana. Trabaja en red con m&uacute;ltiples organizaciones, con capacidad para incidir en la toma de decisiones y en las pol&iacute;ticas p&uacute;blicas. \r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 5.69925, -76.6567);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(135, 'Instituto de Investigaciones Ambientales del Pacifico John Von Neumann', 2, 34, 2, 1, 5, 2, '820000142', 3, 'IIAP', '5746709129', '', '', '5746709126', 'http://www.iiap.org.co/', 'Carrera 1A # 22 &ndash; 96', 12, 601, 'William Klinger', 'El Instituto de Investigaciones Ambientales del Pac&iacute;fico tiene por Misi&oacute;n actuar como instrumento de coordinaci&oacute;n y apoyo al fortalecimiento de la capacidad de investigaci&oacute;n de la regi&oacute;n y de sus actores sociales e institucionales.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 11.2378, -74.2147),
(136, 'Instituto de Investigaciones Marinas y Costeras Jos&eacute; Benito Vives de Andreis', 2, 34, 2, 1, 5, 2, '800250062', 3, 'INVEMAR', '5754328600', '', '', '5754328694', 'http://www.invemar.org.co/', 'Avenida Del Libertador # 32 - 201', 19, 678, 'Francisco Armando Arias', 'El Instituto de Investigaciones Marinas y costeras busca Realizar investigaci&oacute;n b&aacute;sica y aplicada de los recursos naturales renovables y del medio ambiente en los litorales y ecosistemas marinos y oce&aacute;nicos de inter&eacute;s nacional con el fin de proporcionar el conocimiento cient&iacute;fico necesario para la formulaci&oacute;n de pol&iacute;ticas, la toma de decisiones y la elaboraci&oacute;n de planes y proyectos que conduzcan al desarrollo de estas, dirigidos al manejo sostenible de los recursos, a la recuperaci&oacute;n del medio ambiente marino y costero y al mejoramiento de la calidad de vida de los colombianos, mediante el empleo racional de la capacidad cient&iacute;fica del Instituto y su articulaci&oacute;n con otras entidades publicas y privadas.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'AN9RlNj2ByfTvvemmR24cPIrIbMdNMdcffXHzjeu', 4.62502, -74.0671),
(137, 'Parques Nacionales Naturales de Colombia', 2, 8, 1, 1, 5, 2, '830016624', 3, 'PNNC', '5713532400', '', '', '', 'http://www.parquesnacionales.gov.co/', 'Carrera 10 # 20 - 30', 33, 3, 'Julia Miranda', ' La entidad esta encargada de la administraci&oacute;n y manejo del Sistema de Parques Nacionales Naturales y la coordinaci&oacute;n del Sistema Nacional de &Aacute;reas Protegidas.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', 0, 0),
(138, 'Artesan&iacute;as de Colombia S.A.', 2, 4, 2, 1, 5, 2, '86000788', 4, '', '', '', '', '', 'http://www.artesaniasdecolombia.com.co/', 'Calle 28 # 13A - 15 Piso 21', 33, 3, 'Aida Vivian Lechter', 'Somos una sociedad de econom&iacute;a mixta del orden nacional, sometida al r&eacute;gimen de las empresas industriales y comerciales del Estado,Tenemos como objetivo principal incrementar la participaci&oacute;n de los artesanos en el sector productivo nacional, logrando un desarrollo integral sostenido que se manifieste en el mejoramiento del nivel de vida, que se refleje tanto en un &iacute;ndice creciente de ingresos y espacios de participaci&oacute;n social, como en una mayor productividad y posicionamiento de la artesan&iacute;a en los mercados locales, regionales, nacionales e internacionales.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.66, -74.0591),
(139, 'Banco de Comercio Exterior de Colombia S.A.', 2, 4, 2, 1, 5, 2, '800149923', 4, 'BANCOLDEX', '5714863000', '', '', '5712862451', 'http://www.bancoldex.com/', 'Calle 28 # 13A - 15, pisos 37 al 42', 33, 3, 'Lu&iacute;s Fernando Castro', 'Es el banco de desarrollo para el crecimiento empresarial en Colombia, apalancando compa&ntilde;&iacute;as de todos los tama&ntilde;os, todos los sectores y todas las regiones de Colombia indistintamente de su tiempo de existencia, con servicios de conocimiento e instrumentos financieros.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.61613, -74.0713);
