(140, 'Fiduciaria Colombiana de Comercio Exterior S.A.', 2, 4, 2, 1, 5, 2, '800178148', 4, 'FIDUCOLDEX', '', '', '', '', '', '', 33, 3, 'Sonia Abisambra', 'Somos una entidad privada sin &aacute;nimo de lucro que busca construir una Bogot&aacute; - Regi&oacute;n sostenible a largo plazo, promoviendo el aumento de la prosperidad de sus habitantes, a partir de servicios que apoyen las capacidades empresariales y que mejoren el entorno para los negocios con incidencia en la pol&iacute;tica p&uacute;blica.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.65718, -74.107),
(141, 'Corporaci&oacute;n Para el Desarrollo de las Microempresas', 2, 34, 2, 1, 5, 2, '800250713', 4, 'CDM', '', '', '', '', '', '', 33, 3, '', '\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.61682, -74.0713),
(142, 'Fondo Nacional de Garant&iacute;as S.A.', 2, 24, 2, 1, 5, 2, '860402272', 4, 'FNG', '5713239000', '', '', '5713239006', 'http://www.fng.gov.co/', 'Calle 26A # 13 - 97 piso 25', 33, 3, 'Juan Carlos Dur&aacute;n', '\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 0, 0),
(143, 'Instituto Nacional de Metrolog&iacute;a', 2, 3, 1, 1, 5, 2, '900494393', 4, 'INM', '5712542222', '', '', '', 'http://www.inm.gov.co/', 'Avenida Carrera 50 # 26 - 55 Int. 2', 33, 3, 'Carlos Eduardo Porras', 'El Fondo Nacional de Garant&iacute;as S.A. es la entidad a trav&eacute;s de la cual el Gobierno Nacional busca facilitar el acceso al cr&eacute;dito para las micro, peque&ntilde;as y medianas empresas, mediante el otorgamiento de garant&iacute;as. \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.61491, -74.0717),
(144, 'Leasing Bancoldex S.A. Compa&ntilde;&iacute;a de Financiamiento Comercial', 2, 4, 2, 1, 5, 2, '800225385', 4, 'LEASING BANCOLDEX', '5713534999', '', '', '5713534950', 'https://www.leasingbancoldex.com/', 'Calle 28 # 13 A &ndash; 15', 33, 3, 'Fernando Esmeral', 'El instituto nacional de metrologia busca Coordinar en el territorio nacional la metrolog&iacute;a cient&iacute;fica e industrial y ejecutar actividades que permitan la innovaci&oacute;n y soporten el desarrollo econ&oacute;mico, cient&iacute;fico y tecnol&oacute;gico del pa&iacute;s.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.64312, -74.0924);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(145, 'Superintendencia de Industria y Comercio', 2, 49, 2, 1, 5, 2, '800176089', 4, 'SUPERINDUSTRIA', '5715870000', '', '', '5715870284', 'http://www.sic.gov.co/', 'Avenida el Dorado # 51 - 80', 33, 3, 'Pablo Felipe Robledo del', 'El Ministerio de Comercio, Industria y Turismo apoya la actividad empresarial, productora de bienes, servicios  y tecnolog&iacute;a, as&iacute; como la gesti&oacute;n tur&iacute;stica de las regiones del pa&iacute;s para mejorar su competitividad y su sostenibilidad e incentivar la generaci&oacute;n de mayor valor agregado.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.61587, -74.0713),
(146, 'Superintendencia de Sociedades', 2, 49, 2, 1, 5, 2, '899999086', 4, 'SUPERSOCIEDADES', '5713245777', '5712201000', '', '5713245000', 'http://www.supersociedades.gov.co/', 'Carrera 7B bis # 132 - 28', 33, 3, 'Ligia Stella Rodr&iacute;guez', 'La SIC salvaguarda los derechos de los consumidores, protege la libre y sana competencia, act&uacute;a como autoridad nacional de la propiedad industrial y defiende los derechos fundamentales relacionados con la correcta administraci&oacute;n de datos personales. De esta manera, la SIC es parte fundamental en la estrategia estatal en favor de la competitividad y la formalizaci&oacute;n de la econom&iacute;a, lo cual incluye la vigilancia a  las c&aacute;maras de comercio y la metrolog&iacute;a legal en Colombia.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSvnkon8-gvT70vPde_c4vbUTZki8Be_GI6UCdhOEuZaYllVKhxCaeOYsQ', 4.61455, -74.0707),
(147, 'Unidad Administrativa Especial Junta Central de Contadores', 2, 3, 1, 1, 5, 2, '900180739', 4, 'UAE-JCC', '5716444450', '', '', '', 'https://www.jcc.gov.co/', 'Carrera 13 # 27 - 00, Pisos. 1, 3, 4, 5, 6, 7 y 10', 33, 3, 'Julio C&eacute;sar Acu&ntilde;a', 'La Superintendencia de Sociedades es un organismo t&eacute;cnico, adscrito al Ministerio de Comercio, Industria y Turismo, con personer&iacute;a jur&iacute;dica, autonom&iacute;a administrativa y patrimonio propio, mediante el cual el Presidente de la Rep&uacute;blica ejerce la inspecci&oacute;n, vigilancia y control de las sociedades mercantiles, as&iacute; como las facultades que le se&ntilde;ala la ley en relaci&oacute;n con otros entes, personas jur&iacute;dicas y personas naturales.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.64341, -74.0949),
(148, 'Archivo General de la Naci&oacute;n', 2, 7, 2, 1, 5, 2, '800128835', 5, 'AGN', '5713282888', '', '', '5713372019', 'http://www.archivogeneral.gov.co/', 'Carrera 6 # 6 - 91', 33, 3, '', '\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTTNnAVPHS0B5QpUm14fRjbwtlIHeL6XYXgshk_hgHsWEvQ-y_EbG4f7SgA', 4.59296, -74.077),
(149, 'Instituto Colombiano de Antropolog&iacute;a e Historia', 2, 7, 2, 1, 5, 2, '830067892', 5, 'ICANH', '5714440544', '', '', '5714440530', 'http://www.icanh.gov.co/', 'Calle 12 # 2 - 41', 33, 3, '', '\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.59656, -74.0707);
