(166, 'Escuela Tecnol&oacute;gica Instituto T&eacute;cnico Central', 2, 7, 2, 1, 5, 2, '860523694', 7, 'ITC', '5713443000', '', '', '5713443029', 'http://www.itc.edu.co/', 'Calle 13 # 16 - 74', 33, 3, '', 'La Escuela Tecnol&oacute;gica Instituto T&eacute;cnico Central forma personas creativas y competentes en las &aacute;reas t&eacute;cnicas, tecnol&oacute;gicas e ingenier&iacute;as capaces de solucionar problemas a trav&eacute;s de la investigaci&oacute;n aplicada.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.60582, -74.0822),
(167, 'Fondo de Desarrollo de la Educaci&oacute;n Superior', 2, 4, 2, 1, 5, 2, '830018957', 7, 'FODESEP', '5713478616', '', '', '5713472310', 'http://www.fodesep.gov.co/', 'Calle 57 # 8B - 05 Int 32', 33, 3, '', '&quot;\r\nSomos una organizaci&oacute;n de econom&iacute;a mixta vinculada al Ministerio de Educaci&oacute;n Nacional de Colombia, de derecho privado, sin fines de lucro, de inter&eacute;s social, organizada bajo los principios de la econom&iacute;a solidaria, Su objetivo es financiar y promover proyectos y programas que benefician a las instituciones de educaci&oacute;n superior, organizaciones de la ense&ntilde;anza p&uacute;blica y privada.&quot;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.64358, -74.0636);
