(168, 'Instituto Colombiano Para la Evaluaci&oacute;n de la Educaci&oacute;n', 2, 23, 1, 1, 5, 2, '860024301', 7, 'ICFES', '5713077008', '', '', '', 'http://www.icfes.gov.co/', 'Carrera 7 # 32 - 16', 33, 3, '', '&quot;Somos el Instituto Colombiano para la Evaluaci&oacute;n de la Educaci&oacute;n, entidad especializada en ofrecer servicios de evaluaci&oacute;n de la educaci&oacute;n en todos sus niveles, y en particular apoyar al Ministerio de Educaci&oacute;n Nacional en la realizaci&oacute;n de los ex&aacute;menes de Estado y en adelantar investigaciones sobre los factores que inciden en la calidad educativa, para ofrecer informaci&oacute;n pertinente y oportuna para contribuir al mejoramiento de la calidad de la educaci&oacute;n.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.66098, -74.1077),
(169, 'Instituto Colombiano de Cr&eacute;dito Educativo y Estudios T&eacute;cnicos en el Exterior  &quot;Mariano Ospina P&eacute;rez&quot;', 2, 23, 1, 1, 5, 2, '899999035', 7, 'ICETEX', '', '', '', '', '', '', 33, 3, '', '\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcTLeDm_IIPA7x4oYmctdJ0fNJP7njhA8eIugwd1K7zdEbj3Vlbc', 4.60247, -74.0686),
(170, 'Instituto Nacional de Formaci&oacute;n T&eacute;cnica Profesional de San Juan del Cesar', 2, 7, 2, 1, 5, 2, '860402193', 7, 'INFOTEP', '5757740098', '5757740404', '', '', 'http://www.infotep.edu.co/', 'Carrera 13N 7A - 61', 18, 674, '', 'Somos una instituci&oacute;n de Educaci&oacute;n Superior del  nivel   t&eacute;cnico profesional, que desarrolla su actividad acad&eacute;mica, investigativa y de proyecci&oacute;n social con criterios de excelencia en la formaci&oacute;n de profesionales integrales,   generando impacto  favorable en el contexto regional, nacional e internacional,  comprometidos con la satisfacci&oacute;n de nuestros grupos de inter&eacute;s en los servicios ofertados.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 10.8916, -72.8381),
(171, 'Instituto Nacional de Formaci&oacute;n T&eacute;cnica Profesional del Departamento de San Andr&eacute;s, Providencia y Santa Catalina', 2, 7, 2, 1, 5, 2, '892400461', 7, '', '', '', '', '', '', 'Carrera 43A # 19 - 127', 26, 871, '', '\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 12.5934, -81.7051),
(172, 'Instituto Nacional Para Ciegos', 2, 7, 2, 1, 5, 2, '860015971', 7, 'INCI', '5713846666', '', '', '5712329076', 'http://www.inci.gov.co/', 'Carrera 13 # 34 - 91', 33, 3, '', '&quot;El Instituto Nacional para Ciegos (INCI) es una entidad de car&aacute;cter t&eacute;cnico asesor adscrita al Ministerio de Educaci&oacute;n Nacional de Colombia.\r\nDesde su creaci&oacute;n el INCI trabaja para garantizar los derechos de los colombianos ciegos y con baja visi&oacute;n irreversible en t&eacute;rminos de inclusi&oacute;n social, educativa, econ&oacute;mica, pol&iacute;tica y cultural.\r\n&quot;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.62278, -74.068);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(173, 'Instituto Nacional Para Sordos', 2, 7, 2, 1, 5, 2, '899999001', 7, 'INSOR', '5713201912', '', '', '', 'http://www.insor.gov.co/', 'Calle 32 A # 19 &ndash; 35 Barrio La Soledad', 33, 3, '', 'El Instituto Nacional para Sordos &ndash; INSOR, tiene como Objeto fundamental promover, desde el sector Educativo, el desarrollo e implementaci&oacute;n de Pol&iacute;tica P&uacute;blica para la Inclusi&oacute;n Social de la Poblaci&oacute;n Sorda. En desarrollo de su objeto, el INSOR coordinara acciones con todos los entes de sector p&uacute;blico y privado en las &aacute;reas de Competencia.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.66631, -74.0599),
(174, 'Instituto T&eacute;cnico Nacional de Comercio &quot;Sim&oacute;n Rodr&iacute;guez&quot;', 2, 7, 2, 1, 5, 2, '800248004', 7, 'INTENALCO', '', '', '', '', 'http://www.intenalco.edu.co/', '', 30, 1031, '', 'INTENALCO forma profesionales con exelentes bases tecnicas, tecnologicas y cientificas, generadores de procesos de cambio, con vision futurista, con valores eticos, autonomos y perseverantes, capaces de asumir riesgos, defender sus derechos, respetar los de los demas y fomentar la conservacion del medio ambiente \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 3.43944, -76.5371),
(175, 'Instituto Tolimense de Formaci&oacute;n T&eacute;cnica Profesional', 2, 7, 2, 1, 5, 2, '800173719', 7, 'ITFIP', '', '', '', '', 'http://www.itfip.edu.co/', 'Calle 18 Carrera 1A', 29, 999, '', 'El ITFIP como Instituci&oacute;n de Educaci&oacute;n Superior, forma integralmente al ser humano por competencias a trav&eacute;s de programas acad&eacute;micos y servicios para generar, transformar, aplicar y difundir conocimientos y tecnolog&iacute;as en la soluci&oacute;n a necesidades del entorno regional y nacional. \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.14718, -74.8922),
(176, 'Agencia del Inspector General de Tributos, Rentas y Contribuciones Parafiscales', 2, 8, 1, 1, 5, 2, '899999090', 8, 'ITRC', '5713907000', '', '', '', 'http://www.itrc.gov.co/', 'Calle 93B 16 - 47 PISO 5', 33, 3, '', 'Somos una entidad con personal altamente calificado, conformado por m&aacute;s de cien servidores p&uacute;blicos, seleccionados mediante pruebas de nivel alto. Contamos con expertos auditores financieros, jur&iacute;dicos, de proceso y sistemas, as&iacute; como con expertos analistas de inteligencia de negocios. As&iacute; mismo, contamos con abogados, investigadores expertos en derecho disciplinario y un equipo de polic&iacute;a judicial para adelantar investigaciones de manera conjunta con la Fiscal&iacute;a General de la Naci&oacute;n, funcionarios judiciales, la Contralor&iacute;a General de la Rep&uacute;blica y dem&aacute;s servidores p&uacute;blicos que cumplan funciones de polic&iacute;a judicial.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.67916, -74.0521);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(177, 'Administradora del Monopolio Rent&iacute;stico de los Juegos de Suerte y Azar', 2, 13, 2, 1, 5, 2, '900505060', 8, 'COLJUEGOS', '5717423368', '', '', '', 'http://www.coljuegos.gov.co/', 'Carrera 11 # 93A - 85', 33, 3, '', 'El objeto de Coljuegos es la explotaci&oacute;n, administraci&oacute;n, operaci&oacute;n y expedici&oacute;n de reglamentos de los juegos que hagan parte del monopolio rent&iacute;stico sobre los juegos de suerte y azar que por disposici&oacute;n legal no sean atribuidos a otra entidad. Es decir, Coljuegos act&uacute;a directamente sobre los Juegos Localizados (casinos, bingos, apuestas en deportes y carreras virtuales); Juegos Novedosos (Baloto- Revancha y S&uacute;per Astro Millonario), las Rifas Nacionales y los Sorteos Promocionales.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.67681, -74.0463),
(178, 'Central de Inversiones S.A.', 2, 23, 1, 1, 5, 2, '860042945', 8, 'CISA', '5715460400', '', '', '5715460475', 'https://www.cisa.gov.co', 'Calle 63 # 11 - 09', 33, 3, 'Carlos Enrique Reyes', 'CISA - CENTRAL DE INVERSIONES S.A. es una sociedad comercial de econom&iacute;a mixta de orden nacional, vinculada al Ministerio de Hacienda y Cr&eacute;dito P&uacute;blico, de naturaleza &uacute;nica, sujeta, en la celebraci&oacute;n de todos sus actos y contratos, al r&eacute;gimen de derecho privado. La sociedad tiene por objeto gestionar, adquirir, administrar, comercializar, cobrar, recaudar, intercambiar, enajenar y arrendar a cualquier t&iacute;tulo, toda clase de bienes inmuebles, muebles, acciones, t&iacute;tulos valores, derechos contractuales, fiduciarios, crediticios o litigiosos, incluidos derechos en procesos liquidatarios, cuyos propietarios sean entidades p&uacute;blicas de cualquier orden o rama, organismos aut&oacute;nomos e independientes previstos en la Constituci&oacute;n Pol&iacute;tica y en la Ley, o sociedades con aportes estatales de r&eacute;gimen especial y patrimonios aut&oacute;nomos titulares de activos provenientes de cualquiera de las entidades descritas, as&iacute; como prestar asesor&iacute;a t&eacute;cnica y profesional a dichas entidades en el diagn&oacute;stico y/o valoraci&oacute;n de sus activos y sobre temas relacionados con el objeto social.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.64933, -74.063),
(179, 'Fondo Adaptaci&oacute;n', 2, 33, 2, 1, 5, 2, '17', 8, '', '5715082054', '', '', '', 'http://sitio.fondoadaptacion.gov.co/', 'Calle 75 #5 - 88', 33, 3, 'German Arce', 'Somos una entidad adscrita al Ministerio de Hacienda y Cr&eacute;dito p&uacute;blico del Gobierno Colombiano que fue inicialmente creada para atender la construcci&oacute;n, reconstrucci&oacute;n, recuperaci&oacute;n y reactivaci&oacute;n econ&oacute;mica y social de las zonas afectadas por los eventos derivados del fen&oacute;meno de La Ni&ntilde;a \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.65569, -74.0558),
(180, 'Fiduciaria la Previsora S.A.', 2, 24, 2, 1, 5, 2, '860525148', 8, 'FIDUPREVISORA', '5715945111', '', '', '', 'http://www.fiduprevisora.com.co/', 'Calle 72 # 10 - 03 Pisos 4, 5, 8, 9', 33, 3, '', 'Fiduprevisora S.A. es una Sociedad de Econom&iacute;a Mixta de car&aacute;cter indirecto y del orden nacional, sometida al r&eacute;gimen de Empresa Industrial y Comercial del Estado, vinculada al Ministerio de Hacienda y Cr&eacute;dito P&uacute;blico, vigilada por la Superintendencia Financiera de Colombia y con control fiscal reglamentado por la Contralor&iacute;a General de la Rep&uacute;blica. Adem&aacute;s cuenta con la Revisor&iacute;a Fiscal de la firma KPMG Ltda. \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.65653, -74.0577),
(181, 'Financiera de Desarrollo Nacional', 2, 24, 2, 1, 5, 2, '860509022', 8, 'FDN', '5713264999', '', '', '5713122161', 'http://www.fdn.com.co/', 'Carrera 7 # 71 - 52 Torre B piso 6', 33, 3, 'Clemente Del Valle', 'En la FDN nos enfocamos en superar los vac&iacute;os del mercado y movilizar a las fuentes de financiaci&oacute;n para lograr el desarrollo de la infraestructura en el pa&iacute;s, bajo una adecuada gesti&oacute;n del riesgo. Esto significa que apoyamos los proyectos con un aporte en financiaci&oacute;n directa y tambi&eacute;n mediante la atracci&oacute;n de diferentes actores clave para lograr una financiaci&oacute;n integral que permita hacer realidad los grandes proyectos de infraestructura que el pa&iacute;s requiere.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.65439, -74.0553);
