(182, 'Financiera de Desarrollo Territorial S.A.', 2, 4, 2, 1, 5, 2, '800096329', 8, 'FINDETER', '5716230311', '5716230388', '', '5716230260', 'http://www.findeter.gov.co/', 'Calle 103 # 19 - 20', 33, 3, 'Luis Fernando Arboleda', 'Somos la Banca de Desarrollo que ofrece soluciones integrales para construir territorios sostenibles a trav&eacute;s de la planeaci&oacute;n, estructuraci&oacute;n, financiaci&oacute;n y asistencia t&eacute;cnica de proyectos de infraestructura, que mejoran la calidad de vida de los colombianos.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.68877, -74.0518),
(183, 'Fondo de Garant&iacute;as de Entidades Cooperativas', 2, 9, 2, 1, 5, 2, '830053319', 8, 'FOGACOOP', '5713202727', '', '', '5713202720', 'http://www.fogacoop.gov.co/', 'Carrera 13 # 32 - 93 Int. 3 / Carrera 13 A # 32 - 30 LC, Parque Residencial Baviera', 33, 3, 'Alvaro Vanegas', 'Somos la entidad administradora del seguro de dep&oacute;sitos de los ahorradores del sector cooperativo financiero en Colombia, y mediante el fortalecimiento permanente y eficiente de la solidez patrimonial, financiera y operativa de la entidad otorgamos un respaldo para el crecimiento sano y sostenido del sector en el pa&iacute;s a trav&eacute;s del seguimiento y la implementaci&oacute;n de las distintas operaciones autorizadas al Fondo.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.61965, -74.0691),
(184, 'Fondo de Garant&iacute;as de Instituciones Financieras', 2, 23, 1, 1, 5, 2, '860530751', 8, 'FOGAFIN', '5713394240', '', '', '5712858587', 'https://www.fogafin.gov.co', 'Carrera 7 # 35 - 40', 33, 3, 'Mar&iacute;a In&eacute;s Agudelo', '\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.62281, -74.0666);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(185, 'La Previsora S.A. Compa&ntilde;&iacute;a de Seguros', 2, 4, 2, 1, 5, 2, '860002400', 8, '', '5713485757', '', '', '', 'http://www.previsora.gov.co/', 'Calle 57 # 9 - 07', 33, 3, '', 'La Previsora S.A. es una sociedad de econom&iacute;a mixta del orden nacional, sometida al r&eacute;gimen de las empresas industriales y comerciales del Estado. Cuenta con personer&iacute;a jur&iacute;dica y autonom&iacute;a administrativa, est&aacute; vinculada al Ministerio de Hacienda y Cr&eacute;dito P&uacute;blico y es vigilada por la Superintendencia Financiera de Colombia.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.64375, 0),
(186, 'Positiva Compa&ntilde;&iacute;a de Seguros S.A.', 2, 24, 2, 1, 5, 2, '860011153', 8, '', '5716502200', '', '', '5716502151', 'https://www.positiva.gov.co/', 'Avenida Carrera 45 # 94 - 72', 33, 3, 'Alvaro Hern&aacute;n Velez', 'Positiva compa&ntilde;&iacute;a de seguros S.A.. &nbsp;Satisface las necesidades de seguridad y protecci&oacute;n&nbsp;de las personas que est&aacute;n&nbsp;dentro del mercado&nbsp;Colombiano&nbsp;con honestidad y compromiso, con la filosof&iacute;a de creer que lo bueno debe ser para todos.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.68256, -74.0573),
(187, 'Sociedad de Activos Especiales S.A.S.', 2, 23, 1, 1, 5, 2, '900265408', 8, 'SAE', '5717431444', '', '', '', 'http://www.saesas.com.co/', 'Calle 93B # 13 - 47', 33, 3, 'Mar&iacute;a Virginia Torres', '\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.67783, -74.0495);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(188, 'Superintendencia de la Econom&iacute;a Solidaria', 2, 49, 2, 1, 5, 2, '830053043', 8, 'SUPERSOLIDARIA', '5714895009', '', '', '', 'http://www.supersolidaria.gov.co/', 'Carrera 7 # 31 - 10 - Pisos 11,15 y 16', 33, 3, 'Martha Nury Beltr&aacute;n', 'Somos un organismo t&eacute;cnico del Estado encargado de supervisar la preservaci&oacute;n de los valores, principios y caracter&iacute;sticas esenciales de las organizaciones de la econom&iacute;a solidaria, as&iacute; como la actividad, los resultados y beneficios para sus asociados. Trabajamos con est&aacute;ndares de calidad para proteger los intereses colectivos, en el marco de una pol&iacute;tica de transparencia y buen gobierno, para generar confianza y fortalecer al sector como alternativa de desarrollo social y econ&oacute;mico de Colombia.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.61742, -74.068),
(189, 'Superintendencia Financiera de Colombia', 2, 49, 2, 1, 5, 2, '890999057', 8, 'SUPERFINANCIERA', '5715940200', '5715940201', '', '5713507999', 'https://www.superfinanciera.gov.co', 'Calle 7 # 4 - 49Jorge Alexander Casta&ntilde;o', 33, 3, '', 'La Superintendencia Financiera de Colombia surgi&oacute; de la fusi&oacute;n de la Superintendencia Bancaria de Colombia en la Superintendencia de Valores, seg&uacute;n lo establecido en el art&iacute;culo 1 del Decreto 4327 de 2005. La entidad es un organismo t&eacute;cnico adscrito al Ministerio de Hacienda y Cr&eacute;dito P&uacute;blico, con personer&iacute;a jur&iacute;dica, autonom&iacute;a administrativa y financiera y patrimonio propio.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.59393, -74.0748),
(190, 'Unidad Administrativa Especial de Contadur&iacute;a General de la Naci&oacute;n', 2, 3, 1, 1, 5, 2, '830025406', 8, 'CGN', '5714926400', '', '', '', 'http://www.contaduria.gov.co/', 'Calle 95 # 15 - 56', 33, 3, 'Pedro Luis Boh&oacute;rquez', 'Somos la entidad rectora responsable de regular la contabilidad general de la naci&oacute;n, con autoridad doctrinaria en materia de interpretaci&oacute;n normativa contable, que uniforma, centraliza y consolida la contabilidad p&uacute;blica, con el fin de elaborar el Balance General, orientado a la toma de decisiones de la administraci&oacute;n p&uacute;blica general, que contribuye a la gesti&oacute;n de un Estado moderno y trasparente.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.68107, -74.0502),
(191, 'Unidad Administrativa Especial de Direcci&oacute;n de Impuestos y Aduanas Nacionales', 2, 3, 1, 1, 5, 2, '800197268', 8, 'DIAN', '5716079999', '', '', '5713337841', 'http://www.dian.gov.co/', 'Carrera 8 # 6C - 38 Edificio San Agust&iacute;n', 33, 3, 'Santiago Rojas', 'La Unidad Administrativa Especial Direcci&oacute;n de Impuestos y Aduanas Nacionales -DIAN- tiene como objeto coadyuvar a garantizar la seguridad fiscal del Estado colombiano y la protecci&oacute;n del orden p&uacute;blico econ&oacute;mico nacional, mediante la administraci&oacute;n y control al debido cumplimiento de las obligaciones tributarias, aduaneras, cambiarias, los derechos de explotaci&oacute;n y gastos de administraci&oacute;n sobre los juegos de suerte y azar explotados por entidades p&uacute;blicas del nivel nacional y la facilitaci&oacute;n de las operaciones de comercio exterior en condiciones de equidad, transparencia y legalidad.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.59421, -74.0789),
(192, 'Unidad Administrativa Especial de Gesti&oacute;n Pensional y Contribuciones Parafiscales de la Protecci&oacute;n Social', 2, 3, 1, 1, 5, 2, '900373913', 8, 'UGPP', '', '', '', '', 'http://www.ugpp.gov.co/', 'Calle 19 # 68A - 18', 33, 3, '', 'La Unidad de Pensiones y Parafiscales &ndash; UGPP, es una entidad del orden nacional, adscrita al Ministerio de Hacienda y Cr&eacute;dito P&uacute;blico. Sus principales objetivos misionales son, en primera instancia, el  reconocimiento de derechos pensionales causados a cargo de administradoras del R&eacute;gimen de Prima Media del orden nacional, y de las entidades p&uacute;blicas del orden nacional que hayan tenido a su cargo el reconocimiento de pensiones, respecto de las cuales se haya decretado o se decrete su liquidaci&oacute;n, y las tareas de seguimiento, colaboraci&oacute;n y determinaci&oacute;n de la adecuada, completa y oportuna liquidaci&oacute;n y pago de las contribuciones parafiscales de la Protecci&oacute;n Social.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.64361, -74.1143);
INSERT INTO `entidad` (`id_ent`, `nom_ent`, `ram_ent`, `car_ent`, `niv_ent`, `ord_ent`, `subord_ent`, `tdoc_ent`, `doc_ent`, `par_ent`, `sig_ent`, `tel1_ent`, `tel2_ent`, `tel3_ent`, `fax_ent`, `web_ent`, `dir_ent`, `dep_ent`, `mun_ent`, `rep_ent`, `des_ent`, `img_ent`, `lat_ent`, `lng_ent`) VALUES
(193, 'Unidad de Informaci&oacute;n y An&aacute;lisis Financiero', 2, 3, 1, 1, 5, 2, '830068074', 8, 'UIAF', '5712885222', '', '', '5713234970', 'https://www.uiaf.gov.co', 'Carrera 7 # 31 - 10, Piso 6 Torre Bancolombia', 33, 3, 'Luis Edmundo Suarez', 'La UIAF es la unidad de inteligencia financiera y econ&oacute;mica del pa&iacute;s y su  misi&oacute;n  se centra en proteger la defensa y seguridad nacional en el &aacute;mbito econ&oacute;mico, mediante inteligencia estrat&eacute;gica y operativa sustentada en tecnolog&iacute;a e innovaci&oacute;n, en un marco de respeto a los Derechos Fundamentales, al Derecho Internacional de los Derechos Humanos  y al Derecho Internacional Humanitario, con el objeto de prevenir y detectar actividades asociadas con los delitos de Lavado de Activos, sus delitos fuente, la Financiaci&oacute;n del Terrorismo y proveer informaci&oacute;n &uacute;til en las Acciones de Extinci&oacute;n de Dominio.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/jpeg;base64,', 4.61742, -74.068),
(194, 'Unidad de Proyecci&oacute;n Normativa y Estudios de Regulaci&oacute;n Financiera', 2, 8, 1, 1, 5, 2, '16', 8, 'URF', '5713811700', '', '', '5713812183', 'http://www.urf.gov.co/', 'Carrera 8 # 6C - 38', 33, 3, 'David Marcell Salamanca', 'La Unidad de Proyecci&oacute;n Normativa y Estudios de Regulaci&oacute;n Financiera URF, tiene como misi&oacute;n la preparaci&oacute;n de la normativa para el ejercicio de la facultad de reglamentaci&oacute;n en materia cambiar&iacute;a, monetaria y crediticia y de las competencias de regulaci&oacute;n e intervenci&oacute;n en las actividades financiera, burs&aacute;til, aseguradora y cualquiera otra relacionada con el manejo, aprovechamiento e inversi&oacute;n de los recursos captados del p&uacute;blico, para su posterior expedici&oacute;n por el Gobierno Nacional,dentro del marco de pol&iacute;tica fijado por el Ministerio de Hacienda y Cr&eacute;dito P&uacute;blico y sin perjuicio de las atribuciones de la Junta Directiva del Banco de la Rep&uacute;blica.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'data:image/png;base64,', 4.59421, -74.0789),
(195, 'Gobernaciones', 2, 38, -1, 2, 1, -1, '', 1, '', '', '', '', '', '', '', -1, -1, '', '', '', 0, 0),
(196, 'Alcald&iacute;as', 2, 5, -1, 2, 3, -1, '', 1, '', '', '', '', '', '', '', -1, -1, '', '', '', 0, 0);
